(53, 'Campionato Assoluto Cervia 2012', '2012-11-10', '2012-11-11', '2012-11-06', 1, 0, 0, 99, 0, 0, 1000, 3000, 500, 0, 1, 0, NULL, '<p align="center"><strong>Kata e Kumite individuale <br /></strong></p>\r\n<p align="center"><strong>10 e 11 novembre &nbsp;- Cervia&nbsp; </strong></p>\r\n<p align="center">PalaCervia via Pinarella, 66 - <a href="https://maps.google.it/maps?q=44.250586,12.357515&amp;ll=44.251101,12.35904&amp;spn=0.012357,0.01929&amp;num=1&amp;t=m&amp;z=16" target="_blank">Mappa</a></p>\r\n<p>&nbsp;</p>\r\n<p><strong>PROGRAMMA&nbsp; SABATO&nbsp; 10 novembre &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="text-decoration: underline;">KATA</span></strong></p>\r\n<table style="margin-left: auto; margin-right: auto;" border="0">\r\n<tbody>\r\n<tr>\r\n<td>h. 13.30 &ndash; 14.00</td>\r\n<td>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n<td>Controllo iscrizioni e operazioni di peso</td>\r\n</tr>\r\n<tr>\r\n<td>h. 14.30&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>Saluto ed inizio gare di Kata</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: left;"><strong>PROGRAMMA&nbsp; DOMENICA 11&nbsp; novembre&nbsp;&nbsp;&nbsp; <span style="text-decoration: underline;">KUMITE</span></strong></p>\r\n<table style="margin-left: auto; margin-right: auto;" border="0">\r\n<tbody>\r\n<tr>\r\n<td>h. 08.00 &ndash; 08.30</td>\r\n<td>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n<td>Controllo iscrizioni e operazioni di peso</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: left;">h. 8.30</td>\r\n<td>&nbsp;</td>\r\n<td>Saluto ed inizio gare di Kumite</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p>La Quota di partecipazione &egrave; di <strong>&euro; 10,00</strong> per specialit&agrave;, da versare in loco, a cura dei responsabili di societ&agrave;</p>', 0, 'gara'),
(54, 'Fasi regionali Campionato italiano preagonisti individuale e a squadre - agonisti a squadre', '2012-11-18', NULL, '2012-11-14', 1, 2, 0, 99, 0, 0, 1000, 3000, 500, 0, 1, 0, NULL, '<p>Domenica 18 Novembre presso l''impianto di S. Marinella in via delle colonie , &nbsp;si disputeranno le fasi regionali del Campionato italiano preagonisti individuali kata e kumite e a squadre e agonisti a squadre.</p>\r\n<p>Le iscrizioni si effettueranno esclusivamente on line&nbsp;</p>', 0, 'gara'),
(56, 'Campionato Italiano Montecatini  2012', '2012-12-08', '2012-12-09', '2012-12-01', 1, 2, 0, 99, 0, 0, 1000, 3000, 500, 0, 1, 0, NULL, '<p style="text-align: center;"><strong>MONTECATINI TERME - 8.9 DICEMBRE 2012<br /></strong></p>\r\n<p style="text-align: center;"><strong>CAMPIONATO ITALIANO MARRONI E NERE, CAMPIONATO ITALIANO CINTURE COLORATE</strong><br /><strong>( BIANCHE -GIALLE &ndash; ARANCIO &ndash; VERDI &ndash; BLU)</strong><br /><strong>KATA E KUMITE A SQUADRE AGONISTI</strong><br /><strong>E KATA SQUADRE PREAGONISTI.</strong></p>\r\n<p style="text-align: center;"><strong>CAMPIONATO ITALIANO KATA E KUMITE INDIVIDUALE PREAGONISTI.</strong></p>\r\n<p style="text-align: left;">Si comunica che in data 8 e 9 dicembre 2012, a Montecatini, presso il Palaterme, Via Cimabue 15, si svolger&agrave; la fase finale dei campionati di seguito descritti, riservata a tutti gli atleti tesserati Fiam per l&rsquo;anno in corso.</p>\r\n<p style="text-align: left;">IL SISTEMA CONSENTE DI ISCRIVERE ALLA GARA TUTTI GLI ATLETI TESSERATI NELL&rsquo;ANNO 2012.<br />LE SOCIETA&rsquo; CHE HANNO L&rsquo;ESIGENZA DI INSERIRE NUOVI ATLETI DOVRANNO PROVVEDERE AL RINNOVO PER LA NUOVA STAGIONE AGONISTICA 2013.<br />IL SISTEMA DI ISCRIZIONI DEL CAMPIONATO ITALIANO PERMETTERA&rsquo; DI ISCRIVERE SIA I VECCHI CHE I NUOVI TESSERATI.<strong><br /></strong></p>', 0, 'gara'),
(57, '1° provinciale agonisti Individuale Kata e Kumite', '2013-02-17', NULL, '2013-02-11', 1, 0, 0, 99, 0, 0, 1000, 3000, 500, 0, 1, 1, NULL, '<p style="text-align: center;"><strong><span style="text-decoration: underline; font-size: small;"><span style="color: #ff0000; text-decoration: underline;">N.B. Le classi di et&agrave; sono da considerarsi nel giorno della gara.</span></span></strong></p>', 0, 'gara'),
(58, 'Camp. Italiano e Coppa Italia FIAM - Fase Interregionale Centro/Nord', '2013-03-17', NULL, '2013-03-13', 1, 0, 0, 99, 0, 0, 1000, 3000, 500, 0, 0, 1, 'jpg', '<p><span style="font-size: small;">FASE INTERREGIONALE DEL CAMPIONATO ITALIANO E COPPA ITALIA FIAM</span></p>\r\n<p>&nbsp;</p>\r\n<p align="center"><span style="text-decoration: underline; font-size: medium;"><em><strong><span style="background-color: #ffff00;">ATTENZIONE, PER LA CATEGORIA DISABILI ISCRIVERE GLI ATLETI IN QUESTO MODO:</span></strong></em></span></p>\r\n<p align="center">&nbsp;</p>\r\n<p><span style="text-decoration: underline;"><strong><span style="font-size: medium;">Sul modulo di iscrizione appariranno le gare alle quali iscrivere gli atleti, dopo&nbsp; le classiche gare &ldquo;KATA&rdquo; &ndash; &ldquo;SANBON&rdquo; &ndash; &ldquo;IPPON&rdquo;&nbsp; apparir&agrave; una colonna denominata &ldquo;HP&rdquo;. Quest&rsquo;ultima, insieme alla gara &ldquo;Kata&rdquo;, &egrave; da selezionare per l&rsquo;iscrizione alla gara riservata agli atleti disabili.</span></strong></span></p>\r\n<p><span style="text-decoration: underline;"><strong><span style="font-size: medium;">All''interno della circolare troverete un esempio visivo di come effettuare regolarmente l''iscrizione della categoria speciale.</span></strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: small;">VEDI ALLEGATI</span></p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #3366ff;">&nbsp;<span style="text-decoration: underline; font-size: large;"><strong><span style="background-color: #ffff00;">ATTENZIONE, PER PROBLEMI TECNICI AL SITO ALCUNE SOCIETA'' NON SONO RIUSCITE AD EFFETTUARE LE ISCRIZIONI QUINDI RIAPRIAMO IL TUTTO FINO ALLE ORE 13.00 DEL 14 MARZO.</span></strong></span></span></p>\r\n<p style="text-align: center;"><span style="text-decoration: underline; font-size: large;"><strong><span style="background-color: #ffff00;">&nbsp;</span></strong></span></p>', 0, 'gara'),
(59, 'Fase regionale camp. ita agonisti individuale', '2013-03-17', NULL, '2013-03-11', 1, 0, 0, 99, 0, 0, 1000, 3000, 500, 0, 1, 1, NULL, '<p>Fase regionale campionato italiano . Agonisti - individuale kata e kumite</p>\r\n<p style="text-align: center;">&nbsp;<span style="font-family: arial black,avant garde; font-size: x-large; color: #ff0000;">ATTENZIONE<br /><span style="font-size: small; color: #000000;">Causa chiusura Via dei dei Pescatori, per raggiungere il PalaDiFiore bisogna percorrere</span></span></p>\r\n<ul>\r\n<li style="font-size: small; color: #000000; text-align: justify;"><span style="font-family: arial black,avant garde; font-size: x-large; color: #ff0000;"><span style="font-size: small; color: #000000;"><span style="font-family: arial black,avant garde; color: #ff0000;"><span style="color: #000000;">per chi proviene dalla Via C. Colombo</span></span>:&nbsp; lungomare Lutazio Catulo e svoltare <span style="font-family: arial black,avant garde; color: #ff0000;"><span style="color: #000000;">a destra</span></span></span></span><span style="font-family: arial black,avant garde;"> su Via dei Pescatori</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial black,avant garde; font-size: x-large; color: #ff0000;"><span style="font-size: small; color: #000000;">&nbsp;<span style="font-family: arial black,avant garde; font-size: x-large; color: #ff0000;"><span style="font-size: small; color: #000000;">per chi proviene dalla Via del Mare</span></span>: lungomare Duilio <span style="font-family: arial black,avant garde; color: #ff0000;"><span style="color: #000000;">e svoltare <span style="font-family: arial black,avant garde; font-size: x-large; color: #ff0000;"><span style="font-size: small; color: #000000;"><span style="font-family: arial black,avant garde; color: #ff0000;"><span style="color: #000000;">a </span></span>sinistra</span></span> con Via dei Pescatori&nbsp;</span></span>&nbsp;</span></span></li>\r\n</ul>\r\n<p style="t