(63, 'Memorial Iliano Bartoli', '2013-10-20', NULL, '2013-10-16', 1, 0, 0, 2, 0, 0, 1000, 3000, 500, 0, 0, 1, 'png', '<p style="text-align: center;"><span style="font-size: x-large; color: #0000ff;">Memorial Iliano Bartoli </span><br /> <br /><span style="text-decoration: underline;"><strong><span style="font-size: small;">KATA - KUMITE SHOBU SANBON</span> </strong></span><br /> <br /> <br /><span style="font-size: small;">Si comunica che il giorno 20 Ottobre 2013, presso il palazzetto dello Sport di Terranuova </span><br /><span style="font-size: small;">Bracciolini (Arezzo) sito in via Adige, si svolger&agrave; il memoria Iliano Bartoli; la gara &egrave; rivolta a tutte </span><br /><span style="font-size: small;">le categorie elencate nell&rsquo;allegato &ldquo;Classi e Categorie 2013&rdquo; </span></p>\r\n<p style="text-align: center;"><br /><span style="font-size: small;"><span style="text-decoration: underline;">PROGRAMMA DOMENICA 20 OTTOBRE 2013</span> </span><br /> <br /><span style="font-size: small;">ore 7,45 ritrovo </span><br /><span style="font-size: small;">ore 8,30 saluto </span><br /><span style="font-size: small;">ore 9,00 inizio gare </span><br /><span style="font-size: small;">ore 11,00 inizio gara speciale per disabili </span><br /><span style="font-size: small;">ore 18,00 circa fine competizione e premiazioni societ&agrave;. </span><br /> <br /> <br /><span style="font-size: small;">Regolamento FIAM, reperibile sul sito federale (www.fiamsport.it) </span><br /><span style="font-size: small; background-color: #ffff00;">In deroga al regolamento sono ammesse le protezioni colorate.</span></p>', 0, 'gara'),
(64, 'CAMPIONATO ITALIANO ASSOLUTO 2013', '2013-11-16', '2013-11-17', '2013-11-12', 1, 0, 0, 2, 0, 0, 1500, 4500, 500, 0, 1, 1, 'png', '<p style="text-align: center;"><strong><span style="font-size: large;">CAMPIONATO ITALIANO ASSOLUTO </span></strong><br /><strong><span style="font-size: large;">CINTURE NERE 2013</span></strong><br /><strong><span style="background-color: #ffff00; font-size: large;"> (APERTO A TUTTE LE ORGANIZZAZIONI)</span></strong></p>\r\n<p style="text-align: center;"><br /><strong><span style="font-size: large;">CAMPIONATO ITALIANO CINTURE MARRONI 2013</span></strong><br /><span style="background-color: #ffff00;"><strong><span style="font-size: large;">(APERTO SOLO AI TESSERATI FIAM)</span></strong></span></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;"><br /><strong><span style="font-size: large;">KATA E KUMITE INDIVIDUALE</span></strong></p>\r\n<p style="text-align: center;"><em><strong><span style="font-size: large;">16 e 17 novembre - Cervia&nbsp;</span></strong></em></p>\r\n<p style="text-align: center;"><em><strong><span style="font-size: large;">Pala Cervia via Pinarella, 66</span></strong></em></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;"><br /><span style="text-decoration: underline;"><strong><span style="font-size: small;">PROGRAMMA SABATO 16 novembre KATA</span></strong></span><br /><span style="font-size: small;">h. 13.30 &ndash; 14.00 Controllo iscrizioni</span><br /><span style="font-size: small;">h. 14.30 Saluto ed inizio gare di Kata</span></p>\r\n<p style="text-align: center;"><span style="font-size: small;">&nbsp;</span></p>\r\n<p style="text-align: center;"><span style="text-decoration: underline;"><strong><span style="font-size: small;">PROGRAMMA DOMENICA 17 novembre KUMITE</span></strong></span><br /><span style="font-size: small;">h. 08.00 &ndash; 08.30 Controllo iscrizioni </span><br /><span style="font-size: small;">h. 8.30 Saluto ed inizio gare di Kumite</span></p>\r\n<p style="text-align: center;"><span style="font-size: small;">&nbsp;</span></p>\r\n<p style="text-align: center;"><strong><span style="font-size: small;">LA QUOTA DI PARTECIPAZIONE &Egrave; DI<span style="text-decoration: underline; background-color: #ccffcc;"> &euro; 15,00 PER SPECIALIT&Agrave;</span>, DA VERSARE IN LOCO, A CURA DEI &nbsp;</span></strong><strong><span style="font-size: small;">RESPONSABILI DI SOCIET&Agrave;.</span></strong></p>\r\n<p style="text-align: center;"><span style="font-size: small; background-color: #ffff00;"><strong><span style="text-decoration: underline;">ATTENZIONE:</span></strong> GLI ATLETI NON IN REGOLA CON IL TESSERAMENTO NON POTRANNO ESSERE ISCRITTI ALLA </span><br /><span style="font-size: small; background-color: #ffff00;">GARA. (VI RICORDIAMO CHE PER TESSERARE GLI ATELTI LA SEGRETERIA HA BISOGNO DI ALMENO 5 </span><br /><span style="font-size: small; background-color: #ffff00;">GIORNI LAVORATIVI DAL RICEVIMENTO DEL PAGAMENTO).</span></p>\r\n<p style="text-align: center;"><span style="font-size: small; background-color: #ffffff;">&nbsp;</span></p>\r\n<p style="text-align: center;"><span style="background-color: #00ffff;"><strong><span style="text-decoration: underline;"><span style="font-size: medium;">Iscrizioni OnLine per iscritti FIAM</span></span></strong></span></p>\r\n<p style="text-align: center;"><strong><span style="text-decoration: underline;"><span style="font-size: medium;">&nbsp;</span></span></strong></p>\r\n<p style="text-align: center;"><span style="text-decoration: underline; font-size: medium; background-color: #ffff99;"><strong>Iscrizioni con modulo Excel (da richiedere&nbsp;al numero 3471073267 (dal luned&igrave; al venerd&igrave; dalle 09.00 alle 13.00) oppure via mail all''indirizzo <a href="mailto:segreteria@fiamsport.it">segreteria@fiamsport.it</a>&nbsp;)&nbsp;per organizzazioni non FIAM</strong></span></p>\r\n<p style="text-align: center;"><span style="font-size: small; background-