(67, 'CAMPIONATO ITALIANO PREAGONISTI - INDIVIDUALE E SQUADRE KATA - INDIVIDUALE KUMITE', '2013-12-07', '2013-12-08', '2013-12-03', 1, 2, 0, 2, 0, 0, 1500, 3000, 0, 0, 0, 1, NULL, '<p style="text-align: center;"><strong><span style="font-size: large;">CAMPIONATO ITALIANO A SQUADRE&nbsp;KATA&nbsp;</span></strong><br /><strong><span style="font-size: large;">CAMPIONATO ITALIANO INDIVIDUALE KATA E KUMITE</span></strong><br /><strong><span style="font-size: large;">- PREAGONISTI -</span></strong></p>\r\n<p style="text-align: center;"><br /><span style="text-decoration: underline;"><span style="font-size: large;">7 e 8 dicembre - Riccione </span></span><br /><span style="text-decoration: underline;"><span style="font-size: large;">Palazzetto PLAYHALL, via Carpi snc, </span></span></p>\r\n<p style="text-align: left;"><br /><span style="font-size: small;"><strong>SABATO 7 dicembre</strong> &ndash; INDIVID. KATA e SQUADRE KATA</span><br /><span style="font-size: small;">h. 12,45 &ndash; 13.30 controllo iscrizioni</span><br /><span style="font-size: small;">h. 13.00 ritrovo Ufficiali di gara e Presidenti di Giuria</span><br /><span style="font-size: small;">h. 13.30 saluto di apertura</span></p>\r\n<p style="text-align: left;"><br /><span style="font-size: small;"><strong>DOMENICA 8 dicembre</strong> INDIVID. KUMITE</span><br /><span style="font-size: small;">h. 08.00 controllo iscrizioni</span><br /><span style="font-size: small;">h. 08.30 saluto di apertura</span></p>', 0, 'gara'),
(68, 'CAMPIONATO ITALIANO AGONISTI A SQUADRE KATA E KUMITE', '2013-12-07', '2013-12-08', '2013-12-03', 1, 1, 0, 2, 0, 0, 1500, 4500, 0, 0, 0, 1, NULL, '<p style="text-align: center;"><span style="font-size: large;"><strong>CAMPIONATO ITALIANO A SQUADRE&nbsp;<strong>KATA E KUMITE</strong></strong></span><br /><span style="font-size: large;"><strong>- AGONISTI -</strong></span></p>\r\n<p style="text-align: center;"><br /><span style="font-size: medium;">7 e 8 dicembre - Riccione&nbsp;</span><br /><span style="font-size: medium;">Palazzetto PLAYHALL, via Carpi snc,</span></p>\r\n<p>&nbsp;</p>\r\n<p><br /><span style="font-size: small;"><strong>SABATO 7 dicembre</strong>&nbsp;&ndash; SQUADRE KATA</span><br /><span style="font-size: small;">h. 12,45 &ndash; 13.30 controllo iscrizioni</span><br /><span style="font-size: small;">h. 13.00 ritrovo Ufficiali di gara e Presidenti di Giuria</span><br /><span style="font-size: small;">h. 13.30 saluto di apertura</span></p>\r\n<p style="text-align: left;"><br /><span style="font-size: small;"><strong>DOMENICA 8 dicembre</strong>&nbsp;SQUADRE KUMITE</span><br /><span style="font-size: small;">h. 08.00 controllo iscrizioni</span><br /><span style="font-size: small;">h. 08.30 saluto di apertura</span></p>', 0, 'gara'),
(69, 'TROFEO LIGURIA', '2014-02-02', NULL, '2014-01-28', 1, 0, 0, 2, 0, 0, 1500, 0, 0, 0, 0, 0, 'jpg', '<p style="text-align: center;" align="JUSTIFY"><span style="font-size: large;"><strong>TROFEO LIGURIA</strong></span></p>\r\n<p style="text-align: center;" align="JUSTIFY"><strong>&nbsp;<span style="font-size: medium;">&nbsp;<span style="font-size: small;">GARA IND.LE KATA INTERSTILE E KUMITE SANBON M/F</span></span></strong></p>\r\n<p style="text-align: center;" align="JUSTIFY"><strong>VALIDA ANCHE COME</strong></p>\r\n<p style="text-align: center;" align="JUSTIFY"><strong><span style="font-size: small;">QUALIFICAZIONE REGIONALE PER GLI ATLETI FIAM LIGURIA</span></strong></p>\r\n<p style="text-align: center;" align="JUSTIFY"><strong><span style="font-size: small;">APERTA A TUTTE LE FEDERAZIONI E ENTI DI PROMOZIONE</span></strong></p>\r\n<p style="text-align: center;" align="JUSTIFY"><strong><span style="font-size: small;">&nbsp;</span></strong></p>\r\n<p style="text-align: center;" align="JUSTIFY"><span style="font-size: small;"><strong>2 Febbraio - Manesseno S.Olcese (Ge)</strong></span></p>\r\n<p style="text-align: center;" align="JUSTIFY"><span style="font-size: small;"><strong>palazzetto Via Don L.Sturzo, 80</strong></span></p>\r\n<p style="text-align: center;" align="JUSTIFY"><strong><span style="font-size: small;">&nbsp;</span></strong></p>\r\n<p style="text-align: center;" align="JUSTIFY"><strong>&nbsp;</strong></p>\r\n<p><span><strong>Ore 7,45 ritrovo</strong></span>&nbsp;</p>\r\n<p><span><strong>Ore 8,30 saluto e inizio gara Atleti Agonisti</strong></span>&nbsp;</p>\r\n<p><span><strong>Ore 11,00 inizio gara Atleti Diversamente Abili</strong></span></p>\r\n<p><strong>Ore 12,30 inizio gara Atleti Preagonisti&nbsp;</strong></p>\r\n<p><span><strong>Ore 18,30 previsione termine gara e premiazioni societ&agrave;</strong></span></p>\r\n<p><span><strong>&nbsp;</strong></span></p>\r\n<p style="text-align: center;"><span><strong>ISCRIZIONI <span style="font-size: medium;">ON LINE</span> COLLEGANDOSI AL SITO&nbsp;</strong></span></p>\r\n<p style="text-align: center;"><span><strong>www.fiamsport.it</strong></span></p>\r\n<p align="JUSTIFY"><strong><span style="font-size: small;">&nbsp;</span></strong></p>', 0, 'gara'),
(70, 'Trofeo preagonisti Memorial Vicomandi', '2014-02-09', NULL, '2014-02-03', 1, 0, 0, 3, 0, 0, 1500, 4500, 500, 0, 1, 1, NULL, '<p>TROFEO MEMORIAL VICOMANDI - riservato ai preagonisti tesserati per l''anno in corso</p>\r\n<p>&nbsp;</p>\r\n<p>Si comunica che il giorno domenica 9 febbraio, presso l&rsquo;impianto di via delle Colonie, Santa Marinella (RM) si svolger&agrave; la Coppa Regionale Agonisti ed il Trofeo Preagonisti denominato Memorial Vicomandi, entrambi riservati ai tesserati FIAM per l&rsquo;anno in corso.</p>\r\n<p>&nbsp;</p>\r\n<p>Le iscrizioni si effettueranno con l&rsquo;ormai consueta modalit&agrave; online sul sito <a href="../">http://www.fiamsport.it/gare</a>, nell&rsquo;area riservata alle societ&agrave;; le iscrizioni si chiuderanno il 31 gennaio alle ore 24.</p>\r\n<p>Alla chiusura delle iscrizioni, sempre nell&rsquo;area riservata di cui sopra, saranno pubblicati tutti i partecipanti , e successivamente, &nbsp;verranno resi disponibili i tabelloni di gara comprensivi di accorpamenti e con gli orari indicativi di inizio di ogni singola gara (va considerato uno scarto di 30 min in eccesso o difetto).</p>\r\n<p>Si raccomandano i responsabili delle societ&agrave; di scaricare il piano delle gare appena eseguiti gli accorpamenti definitivi e di presentarsi alla gara con tutta la documentazione pronta, onde evitare richieste di stampa al tavolo centrale.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PROGRAMMA </strong></p>\r\n<p>h. 8.00 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Controllo iscrizioni</p>\r\n<p>h. 8.30 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Inizio gara kata preagonisti</p>\r\n<p>h 10.30&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Controllo peso preagonisti kumite</p>\r\n<p>a seguire&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Inizio gara kumite preagonisti</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>Per motivi di carattere organizzativo il Responsabile e il Coordinatore di gara si riservano di poter accorpare alcune categorie di peso, rispettando il principio dell&rsquo;et&agrave; e del grado.</p>\r\n<p>La categoria di appartenenza &egrave; determinata dall&rsquo;et&agrave; dell&rsquo;atleta al giorno della competizione.</p>\r\n<p>&nbsp;</p>\r\n<p>La quota di partecipazione &egrave; di <strong>15,00 euro</strong> per ognuna delle gare previste, da versarsi direttamente sul luogo prima della gara.</p>\r\n<p>La lista nominativa degli atleti dovr&agrave; essere registrata on line utilizzando il sito web ufficiale segnalando attraverso l&rsquo;apposita funzionalit&agrave;, eventuali problemi.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>ATTENZIONE: </strong></p>\r\n<p><strong>L&rsquo;iscrizione on line suppone che sia la societ&agrave; che gli atleti siano in regola con il tesseramento dell&rsquo;anno sportivo 2013 &ndash; 2014 cio&egrave; fruiscano delle coperture assicurative messe a disposizione dalla FIAM . </strong></p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></p>\r\n<p><strong>Si avvisano tutti i responsabili tecnici e sociali che non verranno assolutamente accettate iscrizioni sul posto.</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p><em>Categorie e pesi da Regolamento FIAM reperibile su <a href="../../">www.fiamsport.it</a></em></p>', 0, 'gara'),
(71, 'Coppa regionale agonisti individuale Kata e Kumite', '2014-02-09', NULL, '2014-02-03', 1, 0, 0, 3, 0, 0, 1500, 4500, 500, 0, 1, 1, NULL, '<p><span style="text-decoration: underline;"><strong><span style="color: #ff0000; font-size: medium; text-decoration: underline;">&nbsp;</span></strong></span></p>\r\n<p>&nbsp;</p>', 0, 'gara'),
(72, 'Campionato Regionale Piemonte', '2014-02-23', NULL, '2014-02-18', 1, 0, 0, 2, 0, 0, 1500, 4500, 0, 0, 0, 1, 'jpg', '<p style="text-align: center;"><span style="font-family: ''times new roman'', times; font-size: xx-large;">FIAM - Piemonte</span></p>\r\n<p style="text-align: center;"><span style="font-size: xx-large; font-family: ''times new roman'', times;"><span style="font-size: large; color: #ff0000;">In collaborazione con</span><br /></span></p>\r\n<p style="text-align: center;"><span style="font-size: xx-large; font-family: ''times new roman'', times;"><span style="font-size: large; color: #ff0000;">a.s.d. Dojo Fujiyama e C.S.K.S. Valle Susa</span></span></p>\r\n<p style="text-align: center;"><span style="font-size: xx-large; font-family: ''times new roman'', times;"><span style="font-size: large; color: #ff0000;">&nbsp;</span></span></p>\r\n<p style="text-align: center;"><span style="font-size: x-large; font-family: ''times new roman'', times;"><span style="color: #ff0000;"><span style="color: #000000;">Organizza</span><br /></span></span></p>\r\n<p style="text-align: center;"><strong><span style="font-size: x-large; font-family: ''times new roman'', times;"><span style="color: #ff0000;"><span style="color: #000000;">DOMENICA 23 FEBBRAIO ORE 14.30</span></span></span></strong></p>\r\n<p style="text-align: center;"><span style="font-size: x-large; font-family: ''times new roman'', times;"><span style="color: #ff0000;"><span style="color: #000000;">&nbsp;</span></span></span></p>\r\n<p style="text-align: center;"><span style="font-size: x-large;"><em><span style="font-family: ''times new roman'', times;"><span style="color: #ff0000;"><span style="color: #000000;">CAMPIONATO REGIONALE FIAM</span></span></span></em></span></p>\r\n<p style="text-align: center;"><span style="font-size: x-large;"><em><span style="font-family: ''times new roman'', times;"><span style="color: #ff0000;"><span style="color: #000000;">RAGAZZI - CADETTI - JUNIOR - SENIOR - OVER</span></span></span></em></span></p>\r\n<p style="text-align: center;"><span style="font-size: x-large;"><em><span style="font-family: ''times new roman'', times;"><span style="color: #ff0000;"><span style="color: #000000;">DIVERSAMENTE ABILI</span></span></span></em></span></p>\r\n<p style="text-align: center;"><span style="font-size: x-large;"><em><span style="font-family: ''times new roman'', times;"><span style="color: #ff0000;"><span style="color: #000000;">&nbsp;</span></span></span></em></span></p>\r\n<p style="text-align: center;"><span style="text-decoration: underline; font-size: x-large;"><strong><em><span style="font-family: ''times new roman'', times;"><span style="color: #ff0000;"><span style="color: #000000; text-decoration: underline;">GARA INDIVIDUALE KATA E KUMITE</span></span></span></em></strong></span></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;"><strong><span style="font-size: large; font-family: ''times new roman'', times;"><span style="color: #ff0000;"><span style="color: #000000;">Aperto a tutte le federazioni e enti di promozione</span></span></span></strong></p>\r\n<p style="text-align: center;"><span style="font-size: large; font-family: ''times new roman'', times;"><span style="color: #ff0000;"><span style="color: #000000;">a <strong>San Francesco al Campo</strong></span></span></span></p>\r\n<p style="text-align: center;"><span style="font-size: large; font-family: ''times new roman'', times;"><span style="color: #ff0000;"><span style="color: #000000;">presso: <strong>Palestra Comunale F.lli Peressotti -&nbsp;</strong></span></span></span><strong><span style="font-family: ''times new roman'', times; font-size: large;">P.zza San Francesco d''Assisi, n.1</span></strong></p>\r\n<p style="text-align: center;"><span style="font-size: large; font-family: ''times new roman'', times;"><span style="color: #ff0000;"><span style="color: #000000;">&nbsp;</span></span></span></p>\r\n<p style="text-align: center;"><span style="font-size: small; font-family: ''times new roman'', times;"><span style="color: #ff0000;"><span style="color: #000000;">per informazioni: mail&nbsp;<a href="mailto:piemonte@fiamsport.it">piemonte@fiamsport.it</a>&nbsp;- cell. 3485187884</span></span></span></p>', 0, 'gara'),
(77, 'Interregionale Centro Nord', '2014-03-30', NULL, '2014-03-25', 1, 0, 0, 3, 0, 0, 1500, 4500, 500, 0, 1, 1, 'jpg', '<p style="text-align: center;"><strong><span style="color: #0000ff; font-size: large;">FASE INTERREGIONALE DEL</span></strong></p>\r\n<p style="text-align: center;"><strong><span style="font-size: large;">CAMPIONATO ITALIANO </span></strong><strong><span style="font-size: large;">CINTURE NERE E COLORATE<br /></span></strong></p>\r\n<p style="text-align: center;"><strong><span style="font-size: large;">INDIVIDUALE<br /></span></strong></p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><strong><span style="font-size: small; text-decoration: underline;">KATA - KUMITE SHOBU SANBON </span></strong><br /><span style="font-size: small;">&nbsp;</span><br /><span style="font-size: small;">&nbsp;</span><br /><span style="font-size: small;">Si comunica che il giorno 30 Marzo 2014, presso il palazzetto di Viadana (MN), si svolgeranno le </span><br /><span style="font-size: small;">FASI interregionali, Agonisti e Preagonisti del Campionato Italiano di kata e kumite (maschile - </span><br /><span style="font-size: small;">femminile) riservato a tutti gli atleti tesserati in FIAM per l&rsquo;anno in corso. </span><br /><span style="font-size: small;">&nbsp;</span><br /><span style="text-decoration: underline;"><span style="font-size: small;"><strong>PROGRAMMA DOMENICA 30 marzo 2014</strong> </span></span><br /><span style="font-size: small;">&nbsp;</span><br /><span style="font-size: small;">(PREAGONISTI) </span><br /><span style="font-size: small;">Ore 08.00 controllo iscrizioni </span><br /><span style="font-size: small;">Ore 08.30 verifica tabelloni </span><br /><span style="font-size: small;">Ore 09.00 inizio gara categoria&nbsp;BAMBINI (5/7 anni) a seguire categorie RAGAZZI (8/13 anni) </span><br /><span style="font-size: small;">Ore 10.00 Categoria disabili&nbsp; kata </span><br /><span style="font-size: small;">&nbsp;</span><br /><span style="font-size: small;">(AGONISTI) </span><br /><span style="font-size: small;">Ore 11.30 circa controllo iscrizioni Agonisti </span><br /><span style="font-size: small;">Ore 12.00 circa inizio gara agonisti </span><br /><span style="font-size: small;">&nbsp;</span><br /><span style="font-size: small;">Categorie e pesi come da Regolamento FIAM, reperibile sul sito </span><br /><span style="font-size: small;">www.fiamsport.it </span><br /><span style="font-size: small;">&nbsp;</span><br /><span style="font-size: small;">Per motivi di carattere organizzativo il Responsabile e il Coordinatore di gara si riservano di poter </span><br /><span style="font-size: small;">Accorpare o scorporare alcune categorie, rispettando il principio dell&rsquo;et&agrave; e del grado. </span><br /><span style="font-size: small;">La quota di partecipazione &egrave; di &euro;uro 15,00 per ognuna delle gare previste, da versarsi </span><br /><span style="font-size: small;">direttamente sul luogo prima della gara. </span><br /><span style="font-size: small;">&nbsp;</span><br /><span style="font-size: small;">&nbsp;</span><br /><span style="font-size: small;">La lista nominativa degli atleti dovr&agrave; pervenire esclusivamente utilizzando il sito federale </span><br /><span style="font-size: small;">entro e non oltre Marted&igrave;&nbsp; 25 MARZO 2014 </span><br /><span style="font-size: small;">&nbsp;</span><br /><span style="font-size: small;">&nbsp;</span><br /><span style="font-size: small;">Per info contattare il seguente indirizzo e-mail: karateviadana@digicolor.net&nbsp;</span></p>', 0, 'gara'),
