(78, 'Campionato Italiano Agonisti e Preagonisti 2014', '2014-04-26', '2014-04-27', '2014-04-18', 1, 0, 0, 6, 0, 0, 1500, 4500, 500, 6000, 1, 1, NULL, '<p style="text-align: center;"><strong><span style="font-size: large;"><span style="font-size: large;"><strong><strong><span style="font-size: large;">&nbsp;CAMPIONATO ITALIANO - PRE AGONISTI 2014</span></strong></strong></span></span></strong></p>\r\n<p style="text-align: center;"><strong><span style="font-size: large;">CAMPIONATO ITALIANO &ndash; DISABILI</span> </strong></p>\r\n<p style="text-align: center;"><strong><span style="font-size: large;"><span style="font-size: large;"><strong>&nbsp;</strong></span></span></strong></p>\r\n<p style="text-align: center;"><strong><span style="font-size: large;"><span style="font-size: large;"><strong>CAMPIONATO ITALIANO - </strong></span>CINTURE COLORATE 2014&nbsp;</span></strong></p>\r\n<p style="text-align: center;"><strong><span style="font-size: large;">CAMPIONATO ITALIANO - MARRONI E NERE 2014&nbsp;</span></strong><br /><strong><span style="font-size: large;">&nbsp;</span></strong><br />&nbsp;&nbsp;<strong><span style="font-size: large;">&nbsp;&nbsp;&nbsp;</span></strong><span style="text-decoration: underline;"><strong><span style="font-size: large;">Rimini&nbsp;&nbsp;</span> </strong></span><br />&nbsp;<br /><em><span style="text-decoration: underline;"><span style="font-size: medium;">Palazzetto STADIUM 105, Piazzale Pasolini 1/C, RIMINI</span> </span></em><br />&nbsp;<br /><span style="text-decoration: underline;"><strong>PROGRAMMA&nbsp; SABATO&nbsp; 26 aprile&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; KATA</strong> </span><br />&nbsp;<br />h. 12.30 &ndash; 13.30&nbsp; Controllo iscrizioni&nbsp; <br />h. 13.00&nbsp; ritrovo Ufficiali di gara e breefing&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br />h. 13.30&nbsp; Saluto ed inizio gare di Kata Preagonisti&nbsp;<br />a seguire Kata Agonisti e kata Disabili&nbsp;</p>\r\n<p style="text-align: center;">h. 16.30 &ndash; 17.30&nbsp; Operazioni di peso <br />&nbsp;<br /><span style="text-decoration: underline;"><strong>PROGRAMMA&nbsp; DOMENICA 27 aprile&nbsp;&nbsp; KUMITE</strong> </span><br />&nbsp;<br />h. 08.00 &ndash; 08.30&nbsp; Controllo iscrizioni e operazioni di peso <br />h. 08.30&nbsp; Saluto ed inizio gare di Kumite Preagonisti&nbsp;<br />a seguire Kumite Agonisti <br />&nbsp;<br /><em><span style="font-size: medium;">Gli orari definitivi saranno inviati alle societ&agrave; qualche giorno prima della gara.</span></em></p>\r\n<p style="text-align: center;"><em><span style="font-size: medium;"><br /></span></em><em><span style="font-size: medium;"><br /></span></em></p>', 0, 'gara'),
(80, 'COPPA WADOKAI  ITALIA ', '2014-05-25', NULL, '2014-05-18', 1, 2, 0, 4, 0, 0, 1500, 4500, 0, 0, 0, 1, 'png', '<p style="text-align: center;"><span style="font-size: x-large;"><strong>COPPA WADOKAI ITALIA </strong></span><br /> <span style="text-decoration: underline;"><span style="font-size: large;">25 Maggio 2014 - ROMA</span> </span><br /><br /> <span style="text-decoration: underline;"><span style="font-size: medium;">&ldquo;CENTRO SPORTIVO COMUNALE&rdquo; </span></span><br /><span style="font-size: medium;"><span style="text-decoration: underline;">Via Giacomo Brogi</span> </span></p>\r\n<p style="text-align: center;"><br /><span style="font-size: medium;"><strong>PROGRAMMA DOMENICA 25 MAGGIO</strong> </span><br /><br /><span style="font-size: medium;">h. 08.15 &ndash; 08.45 Controllo iscrizioni e operazioni di peso </span><br /><span style="font-size: medium;">h. 09.00 Saluto ed inizio gare</span></p>\r\n<p style="text-align: center;"><span style="font-size: medium;">&nbsp;</span></p>\r\n<p style="text-align: center;"><span style="text-decoration: underline;"><strong><span style="color: #0000ff; font-size: medium; text-decoration: underline;">LA GARA COSTITUIRA'' REQUISITO INDISPENSABILE DI </span></strong></span><br /><span style="text-decoration: underline;"><strong><span style="color: #0000ff; font-size: medium; text-decoration: underline;">SELEZIONE PER PARTECIPARE ALLA COPPA EUROPA WADO-KAI </span></strong></span><br /><span style="text-decoration: underline;"><strong><span style="color: #0000ff; font-size: medium; text-decoration: underline;">CHE SI SVOLGER&Agrave; IL 1 NOVEMBRE C.A. !</span></strong></span></p>\r\n<p style="text-align: center;"><span style="text-decoration: underline;"><strong><span style="font-size: medium;">&nbsp;</span></strong></span></p>\r\n<p style="text-align: center;"><span style="text-decoration: underline; background-color: #ffff99;"><strong><span style="font-size: medium;">&nbsp;</span></strong></span></p>\r\n<p style="te