(81, 'Gara Regionale Lazio 2014', '2014-10-19', NULL, '2014-10-17', 1, 0, 0, 3, 0, 0, 1500, 4500, 500, 0, 1, 1, NULL, '<p><strong>Oggetto</strong>: Gara Regionale Agonisti</p>\r\n<p>&nbsp;</p>\r\n<p>Si comunica che il giorno domenica 19 Ottobre p.v., presso l&rsquo;impianto di via delle Colonie, Santa Marinella (RM) si svolger&agrave; la Gara Regionale Agonisti, riservati ai tesserati FIAM per l&rsquo;anno in corso.</p>\r\n<p>&nbsp;</p>\r\n<p>La gara si svolger&agrave; secondo il regolamento FIAM, eccetto per il torneo di Kata che sar&agrave; per tutte le categorie arbitrato secondo il sistema delle bandierine.</p>\r\n<p>&nbsp;</p>\r\n<p>Le iscrizioni si effettueranno con l&rsquo;ormai consueta modalit&agrave; online sul sito <a href="../">http://www.fiamsport.it/gare</a>, nell&rsquo;area riservata alle societ&agrave;; le iscrizioni si chiuderanno il 17 Ottobre p.v. alle ore 24</p>', 0, 'gara'),
