(86, 'TROFEO LIGURIA', '2015-02-01', NULL, '2015-01-25', 1, 0, 0, 2, 0, 0, 1500, 0, 0, 0, 0, 1, 'jpg', '<p style="text-align: center;"><strong>GARA INTERREGIONALE CINTURE NERE E COLORATE INDIVIDUALE</strong></p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><strong><span style="text-decoration: underline; font-size: x-small;">KATA - KUMITE SHOBU SANBON</span></strong></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">Si comunica che il giorno <strong>01 FEBBRAIO 2015</strong>, presso il palazzetto dello sport di Manesseno - S.Olcese via L.Sturzo n.80, si svolger&agrave; il <strong>TROFEO LIGURIA</strong>, gara riservata ad Agonisti e Preagonisti di Kata e Kumite ( maschile - femminile ), <strong>aperta a tutte le organizzazioni.</strong></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;"><span style="text-decoration: underline;"><strong>&nbsp;</strong></span></p>', 0, 'gara'),
(87, 'Fase regionale LAZIO campionato italiano individuale ago e pre', '2015-03-08', NULL, '2015-03-03', 1, 0, 0, 3, 0, 0, 1500, 0, 0, 6000, 0, 1, NULL, '<p>Il palazzetto Palaiaia si trova a Palestrina (RM)</p>\r\n<p>Via Pedemontana 223, 00036</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Le quote da versare decurtate dei rimborsi per gli ufficiali di gara e o medico &nbsp;che la societ&agrave; mette a disposizione per la gara, come risulta dal software di iscrizione, vanno &nbsp;versate esclusivamente tramite bonifico intestao alla asd organizzatrice.</p>\r\n<p>&nbsp;</p>\r\n<p>URBE KARATE ASD</p>\r\n<p>&nbsp;</p>\r\n<p><span>IBAN: IT 49 H 02008 05224 000401175033&nbsp;</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Non sono ammessi pagamenti sul posto.</span></p>\r\n<p>Le ricevute dei versamenti vanno inviate in copia per email all''indirizzo <a href="mailto:roma@fiamsport.it">roma@fiamsport.it</a>&nbsp;entro i termini di chiusura iscrizioni. In alternativa potete fotografare la ricevuta ed inviarla anche con whatsApp al numero 3479432157.</p>\r\n<p>&nbsp;</p>\r\n<p>Grazie</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 0, 'gara'),
(88, 'CAMPIONATO ITALIANO 2015', '2015-03-28', '2015-03-29', '2015-03-20', 1, 0, 0, 3, 0, 0, 1500, 4500, 0, 6000, 0, 1, 'png', '<p style="text-align: left;"><span style="font-size: x-large;"><strong>CAMPIONATO ITALIANO AGONISTI 2015 </strong></span><br /><span style="font-size: x-large;"><strong>CAMPIONATO ITALIANO PRE AGONISTI 2015 </strong></span><br /><span style="font-size: x-large;"><strong>&nbsp;</strong></span><br /><span style="font-size: x-large;"><strong>CAMPIONATO ITALIANO CINTURE COLORATE 2015 </strong></span><br /><span style="font-size: x-large;"><strong>CAMPIONATO ITALIANO DISABILI 2015 </strong></span><br />&nbsp;<br />&nbsp;<br /><span style="color: #0000ff; text-decoration: underline;"><span style="font-size: large;">28 e 29 Marzo &ndash; RICCIONE&nbsp; </span></span><br /><br /><span style="color: #0000ff; text-decoration: underline;"><span style="font-size: large;">Palazzetto PLAYHALL, via Carpi snc&nbsp; </span></span><br />&nbsp;<br />&nbsp;<br /><span style="font-size: small;">PROGRAMMA SABATO&nbsp; 28 Marzo&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p style="text-align: left;"><span style="font-size: small;"><span style="text-decoration: underline;">SPECIALITA&rsquo; KATA</span> </span><br /><span style="font-size: small;">&nbsp;</span><br /><span style="font-size: small;">h. 13.00 &ndash; 14.00&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Controllo iscrizioni&nbsp; </span><br /><span style="font-size: small;">h. 13.00&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ritrovo Ufficiali di gara e briefing&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><br /><span style="font-size: small;">h. 14.00&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp