(89, '1° CAMPIONATO INTERREGIONALE CENTRO-SUD UNIKA', '2015-05-03', NULL, '2015-04-27', 1, 0, 0, 4, 0, 0, 2000, 4500, 500, 6000, 1, 1, 'png', '<p><span style="font-family: ''arial black'', ''avant garde''; font-size: large;">1&deg; CAMPIONATO INTERREGIONALE CENTRO-SUD UNIKA</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: small;">Domenica 03 Maggio 2015, presso il Palazzetto&nbsp;dello Sport &ndash; PALAFIAM, sito in Via Pedemontana 223, 00036 Palestrina (RM)&nbsp;si svolger&agrave; il 1&deg; Campionato interregionale centro-sud, riservato alla categoria&nbsp;Agonisti (specialit&agrave; kata e kumite individuale), riservata ai tesserati delle&nbsp;federazioni aderenti a UNIKA.</span></p>\r\n<p><span style="font-size: small;">La quota di partecipazione &egrave; di 20,00 euro per specialit&agrave;</span></p>\r\n<p><em><span style="font-size: medium;">DA VERSARE ESCLUSIVAMENTE TRAMITE BONIFICO BANCARIO SUL CONTO CORRENTE FIAM.</span></em></p>\r\n<p><em><span style="font-size: medium;">IBAN: IT 22 W 05584 03241 000000000920</span></em></p>\r\n<p><em>con causale "<span style="font-size: medium;"><strong><em style="color: #000000; font-family: Ubuntu, sans-serif; font-size: 12px; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: -webkit-center; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px;">Gara: 1&deg; CAMPIONATO INTERREGIONALE CENTRO-SUD UNIKA</em></strong></span>"</em></p>\r\n<p><em><span style="font-size: medium;">&nbsp;</span></em></p>', 0, 'gara'),
