(95, 'UNIKA 2015 - Campionato Italiano Assoluto Preagonisti e Agonisti ', '2015-12-05', '2015-12-06', '2015-11-27', 1, 0, 0, 5, 0, 0, 2000, 4500, 500, 6000, 0, 1, 'jpg', '<p style="text-align: center;"><span style="font-size: medium; font-family: ''andale mono'', times;"><strong>CAMPIONATO ITALIANO ASSOLUTO INDIVIDUALE&nbsp;</strong></span><span style="font-size: medium; font-family: ''andale mono'', times;"><strong>KATA E KUMITE</strong></span></p>\r\n<p style="text-align: center;"><br /><span style="font-size: medium; font-family: ''andale mono'', times;"><strong>PREAGONISTI E AGONISTI </strong></span><span style="font-size: medium; font-family: ''andale mono'', times;"><strong>COLORATE / MARRONI E NERE</strong></span><br /><span style="font-size: medium; font-family: ''andale mono'', times;"><strong>5 e 6 Dicembre &ndash; RICCIONE -&nbsp;</strong></span><span style="font-size: medium; font-family: ''andale mono'', times;"><strong>Palazzetto PLAYHALL, via Carpi snc</strong></span></p>\r\n<p style="text-align: center;"><span style="font-size: medium; font-family: ''andale mono'', times;"><strong>&nbsp;</strong></span></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p class="Default">La chiusura delle iscrizioni sar&agrave; <strong>venerdi&rsquo; 27 novembre 2015. </strong></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p class="Default">Dopo la mezzanotte di suddetto giorno il sistema informatico di gestione gara non consentir&agrave; pi&ugrave; di inserire nuovi atleti.</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p class="Default">La quota di partecipazione &egrave; di <strong>&euro; 20,00 </strong>per specialit&agrave;, da versare</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p class="Default"><strong>esclusivamente tramite bonifico bancario</strong></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p class="Default">sul conto corrente UNIKA:</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p>iban: <strong>it 37 o 05584 03241 000000002111</strong></p>\r\n<p style="text-align: center;"><span style="font-size: medium; font-family: ''andale mono'', times;"><strong>&nbsp;</strong></span></p>', 0, 'gara'),
(91, 'Coppa Italia Wadokai 2015', '2015-05-24', NULL, '2015-05-16', 1, 0, 0, 5, 0, 0, 1500, 4500, 500, 6000, 1, 1, 'jpg', '<p><strong><span style="color: #000000; font-size: large;">COPPA ITALIA WADOKAI</span></strong></p>\r\n<p><br /><span style="font-size: small;">Il giorno 24 Maggio 2015, presso il Palazzetto dello Sport &ndash; PALAFIAM, sito in Via Pedemontana 223, 00036 Palestrina (RM) si svolger&agrave; la COPPA ITALIA WADOKAI (specialit&agrave; kata e kumite individuale).</span></p>\r\n<p><br /><span style="font-size: small;">Il regolamento arbitrale sar&agrave; quello della &ldquo;WADOKAI EUROPE&rdquo; (WKF).</span></p>\r\n<p><span style="font-size: small;">PROGRAMMA</span><br /><span style="font-size: small;">h. 8.30 Controllo iscrizioni</span><br /><span style="font-size: small;">h. 9.00 Saluto di apertura ed inizio gara kata A seguire inizio gara di kumite</span></p>\r\n<p><span style="font-size: medium;">La quota di partecipazione &egrave; di 15,00 euro, da versarsi ESCLUSIVAMENTE TRAMITE BONIFICO BANCARIO</span><br /><span style="font-size: medium;">SUL CONTO CORRENTE FIAM:</span></p>\r\n<p><span style="font-size: medium;"> IBAN: IT 22 W 05584 03241 000000000920</span></p>\r\n<p><span style="font-size: small;">La gara costituir&agrave; requisito di selezione per partecipare alla Coppa Europa Wadokai che si svolger&agrave; il 30/31 ottobre 2015 in Lussemburgo (LUX)</span></p>', 0, 'gara'),
(96, 'Prova Gara', '2016-02-21', NULL, '2016-02-20', 1, 2, 0, 3, 0, 0, 1500, 3000, 500, 6000, 0, 1, NULL, '<p>prova</p>', 0, 'gara'),
(98, 'TROFEO LIGURIA', '2016-02-21', NULL, '2016-02-12', 1, 0, 0, 2, 0, 0, 1500, 4500, 0, 2000, 1, 1, 'jpg', '<p align="center"><strong>GARA INTERREGIONALE CINTURE NERE E COLORATE</strong></p>\r\n<p align="center"><strong>&nbsp;</strong></p>\r\n<p align="center"><strong>KATA IND.LE E SQUADRE &ndash; KUMITE SHOBU SANBON IND.LE</strong></p>\r\n<p align="center"><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>Si comunica che il giorno 21 FEBBRAIO 2016, presso il palazzetto di Manesseno - S.Olcese via L.Sturzo n.80, si svolger&agrave; il TROFEO LIGURIA, per Agonisti e Preagonisti &nbsp;Kata Ind.le e Squadre - Kumite Shobu Sanbon (solo Ind.le), aperto a tutti gli Atleti maschi e femmine di ogni Federazione e Ente di Promozione</p>\r\n<p>&nbsp;</p>\r\n<p><strong><span>PROGRAMMA</span></strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>(PREAGONISTI)</strong></p>\r\n<p>Ore 8,00 controllo iscrizioni</p>\r\n<p>Ore 9,00 inizio gara categoria BAMBINI (5/7 anni) a seguire categorie RAGAZZI (8/13 ANNI)</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>(AGONISTI)</strong></p>\r\n<p>Ore 11,00 controllo iscrizioni Agonisti</p>\r\n<p>Ore 11,30 circa inizio gara Agonisti</p>\r\n<p>Ore 19,00 previsione termine gara</p>\r\n<p>&nbsp;</p>\r\n<p><strong><span>In deroga al regolamento verranno accettate protezioni di ogni colore.</span></strong></p>\r\n<p style="text-align: justify;"><span style="font-size: small; background-color: #ffff99;"><strong>Ricordiamo alle federazioni esterne FIAM che nelle gare di Kumite Sanbon per le categorie Bambini, Ragazzi1 e Ragazzi2 &egrave; obbligatorio il caschetto mentre per la categoria Ragazzi3 non &egrave; permesso il caschetto ed &egrave; obbligatorio il paradenti.</strong></span></p>\r\n<p><span style="background-color: #ffff99;"><strong>&nbsp;</strong></span></p>\r\n<p>La quota di partecipazione &egrave; di&nbsp;<strong>EURO 15.00</strong>&nbsp;per ogni gara individuale e di&nbsp;<strong>EURO 30.00&nbsp;</strong>a squadra, da versarsi direttamente sul luogo prima della gara.</p>\r\n<p><strong><span>&nbsp;</span></strong></p>\r\n<p><strong><span>Per le Societ&agrave; non iscritte a FIAM seguire la guida allegato</span></strong><strong><span>&nbsp;</span></strong></p>\r\n<p><strong><span>&nbsp;</span></strong></p>\r\n<p><span style="font-size: small; background-color: #ffff00;"><strong>Per le iscrizione delle squadre sia per Societ&agrave; iscritte a FIAM che per non iscritte compilare il modulo allegato in ogni sua parte ed inviarlo a&nbsp;<a href="mailto:info@csklcampomorone.it"><span style="background-color: #ffff00;">info@csklcampomorone.it</span></a>&nbsp;entro e non oltre il 12 FEBBRAIO 2016</strong></span></p>\r\n<p>&nbsp;</p>', 0, 'gara'),
(99, 'UNIKA -Campionato Italiano Individuale - Riccione 23/24 Aprile 2016', '2016-04-23', '2016-04-24', '2016-04-15', 1, 0, 0, 0, 0, 0, 2000, 4500, 500, 0, 1, 1, 'jpg', '<p style="text-align: center;"><span style="font-size: large;"><strong>CAMPIONATO ITALIANO INDIVIDUALE&nbsp;</strong></span><span style="font-size: large;"><strong>KATA E KUMITE</strong></span><br /><span style="font-size: large;"><strong>PREAGONISTI E AGONISTI&nbsp;</strong></span><span style="font-size: large;"><strong>COLORATE / MARRONI E NERE</strong></span><br /><span style="font-size: large;"><strong>23 e 24 Aprile &ndash; RICCIONE</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Palazzetto PLAYHALL, via Carpi snc</span></p>\r\n<p style="text-align: justify;"><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;">PROGRAMMA SABATO 23 Aprile SPECIALITA&rsquo; KATA</span><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;">h. 12.00 &ndash; 12.30 Ritrovo per gli ufficiali di gara</span><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;">h. 13.00 Saluto ed inizio gare di Kata Preagonisti</span><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;">a seguire Agonisti</span></p>\r\n<p style="text-align: justify;"><span style="font-size: small; font-family: arial, helvetica, sans-serif;">h. 17.00 operazioni di peso</span><br /><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;">PROGRAMMA DOMENICA 24 Aprile SPECIALITA&rsquo; KUMITE</span><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;">h. 08.00 &ndash; 08.30 Controllo iscrizioni e operazioni di peso a campione</span><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;">h. 08.30 Saluto ed inizio gare di Kumite Preagonisti</span><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;">a seguire Kumite Agonisti</span></p>\r\n<p style="text-align: justify;"><span style="font-size: small; font-family: arial, helvetica, sans-serif;">&nbsp;</span></p>\r\n<p style="text-align: center;"><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #ff0000; background-color: #ffff00;"><strong><span style="font-size: large;">ATTENZIONE</span></strong><br /></span></p>\r\n<p style="text-align: center;"><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #ff0000; background-color: #ffff00;"><strong><span style="font-size: large;">&nbsp;</span></strong></span></p>\r\n<p style="text-align: left;"><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #ff0000; background-color: #ffff00;"><strong><span style="font-size: large;">Alcune categorie di Kata molto numerose sono state divise in pi&ugrave; gare, fate riferimento ai riepiloghi che vi arriveranno via mail.</span></strong></span></p>\r\n<p style="text-align: left;"><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #ff0000; background-color: #ffff00;"><strong><span style="font-size: large;">&nbsp;</span></strong></span></p>\r\n<p style="text-align: left;"><span style="font-size: small; font-family: arial, helvetica, sans-serif;"><strong><span style="font-size: large;">&nbsp;</span></strong></span></p>', 0, 'gara'),
(100, 'Rengokai - Kata - UNIKA  - Riccione 23/24 Aprile 2016', '2016-04-23', '2016-04-24', '2016-04-15', 1, 0, 0, 0, 0, 0, 2000, 4500, 500, 0, 0, 1, 'png', '<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="font-size: medium;"><strong>CAMPIONATO ITALIANO INDIVIDUALE</strong></span><br /><span style="font-size: medium;"><strong>KATA E KUMITE</strong></span><br /><span style="font-size: medium;"><strong>PREAGONISTI E AGONISTI</strong></span><br /><span style="font-size: medium;"><strong>COLORATE / MARRONI E NERE</strong></span><br /><span style="font-size: medium;"><strong>23 e 24 Aprile &ndash; RICCIONE</strong></span></p>\r\n<p style="text-align: center;"><span>Palazzetto PLAYHALL, via Carpi snc</span></p>\r\n<p style="text-align: center;"><span style="font-family: ''arial black'', ''avant garde''; font-size: x-large;"><strong>GARA KATA RENGOKAI</strong></span></p>\r\n<p style="text-align: center;"><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">RISERVATA ALLE CATEGORIE CADETTI A/B &ndash; JUNIORES/SENIORES MARRONI E NERE.</span></p>\r\n<p>&nbsp;</p>\r\n<p>SI COMUNICA AGLI INTERESSATI CHE IN TUTTE LE PROVE PREVISTE SI POTR&Agrave; SCEGLIERE LIBERAMENTE IL KATA DA ESEGUIRE (TOKUI DI OGNI STILE) E DOVR&Agrave; ESSERE CAMBIATO AD OGNI PROVA.</p>', 0, 'gara'),
