(118, 'Iscrizioni Italiane al 11th WKC World Championships for Over 40', '2016-06-25', '2016-06-26', '2016-06-17', 1, 0, 0, 99, 0, 1, 3500, 0, 3500, 0, 0, 1, 'jpg', '<p><span style="font-size: small;"><span style="color: #000000; font-family: Ubuntu, sans-serif; font-size: small; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; float: none; display: inline !important; background-color: #ffffff;">Iscrizioni delle categorie </span><span style="color: #000000; font-family: Ubuntu, sans-serif; font-size: small; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: #ffffff;">over per i Campionati del Mondo WKC</span></span></p>', 0, 'gara'),
(135, 'CAMPIONATO ITALIANO INDIVIDUALE AGONISTI - COPPA ITALIA INDIVIDUALE PRE-AGONISTI E OVER 40 ', '2017-04-08', '2017-04-09', '2017-03-31', 1, 0, 0, 3, 0, 0, 1500, 4500, 500, 6000, 1, 1, NULL, '<p><strong>CAMPIONATO ITALIANO INDIVIDUALE AGONISTI</strong></p>\r\n<p><strong>COPPA ITALIA INDIVIDUALE PRE-AGONISTI E OVER 40&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Comunichiamo a tutti gli affiliati che nei giorni 8 e 9 aprile P.V. presso il Palazzetto <br />dello Sport di Cervia in via Pinarella 66 avr&agrave; luogo la gara in oggetto. <br /> <br /><span style="text-decoration: underline;"><strong>PROGRAMMA SABATO 8 aprile SPECIALITA&rsquo; KATA</strong> </span><br />h. 12.30 &ndash; 13.00 Ritrovo <br />h. 13.30 Saluto ed inizio gare di Kata Preagonisti a seguire le altre categorie. <br />h. 15.00 &ndash; 17.00 Inizio controllo peso per gli atleti presenti. <br /> <br /><span style="text-decoration: underline;"><strong>PROGRAMMA DOMENICA 9 aprile SPECIALITA&rsquo; KUMITE</strong> </span><br />h. 08.00 Controllo iscrizioni <br />h. 08.00-8.50 Controllo peso per tutti gli atleti. <br />h. 09.00 Saluto ed inizio gare di Kumite Preagonisti a seguire le altre categorie <br />h. 10.30 Gara kata categoria diversamente abili.</p>\r\n<p><span style="text-decoration: underline;"><strong>LA CHIUSURA DELLE ISCRIZIONI SAR&Agrave; VENERDI&rsquo; 31 MARZO 2017.</strong> </span><br /><br />LA QUOTA DI PARTECIPAZIONE &Egrave; DI &euro; 15,00 PER SPECIALIT&Agrave; INDIVIDUALE DA VERSARE <br />ESCLUSIVAMENTE TRAMITE BONIFICO BANCARIO SUL CONTO CORRENTE INTESTATO A FIAM <br /> <br />CODICE IBAN: IT 22 W 05584 03241 000000000920 <br />CAUSALE: &ldquo;nome societ&agrave; CAMPIONATO ITALIANO Cervia 8/9 aprile&rdquo; <br /> <br />NON SI ACCETTANO PAGAMENTI IN LOCO.</p>', 0, 'gara'),
(120, 'COPPA ITALIA WADOKAI - 2016 PALAFIAM Palestrina (RM)', '2016-10-16', NULL, '2016-10-07', 1, 0, 0, 5, 0, 0, 1500, 0, 0, 6000, 0, 1, 'png', '<p><span style="font-family: ''arial black'', ''avant garde''; font-size: medium;"><strong>COPPA ITALIA WADOKAI&nbsp;</strong></span></p>\r\n<p><br />Si comunica che il giorno domenica 16 OTTOBRE 2016, presso il Palazzetto dello Sport &ndash;<br />PALAFIAM, sito in Via Pedemontana 223, 00036 Palestrina (RM) si svolger&agrave; la COPPA ITALIA<br />WADOKAI (specialit&agrave; kata e kumite individuale), COPPA ITALIA RENGOKAI (specialit&agrave; kata<br />interstile) e COPPA REGIONALE KATA (gara kata interstile categorie pre-agonisti e Over 40)</p>\r\n<p><br />Le iscrizioni, che dovranno essere effettuate utilizzando la modalit&agrave; online<br />sul sito http://www.fiamsport.it/gare, si chiuderanno Venerd&igrave; 7 ottobre alle ore 24.00.</p>\r\n<p>Il regolamento arbitrale sar&agrave; quello della &ldquo;WADOKAI EUROPE&rdquo; (WKF)<br />COPPA ITALIA WADOKAI (Categorie da regolamento WADOKAI EUROPE):<br />CLASSI D''ETA'' (KATA E KUMITE)<br />CATEGORIE DI PESO KUMITE<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;FEMMINE &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; MASCHI<br />RAGAZZI/E (U14)&nbsp;11/13 anni &nbsp; &nbsp;kg. -40/-50/+50 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; kg. -40/-50/+50</p>\r\n<p>CADETTI/E A (U16)&nbsp;14/15 anni &nbsp;kg. -47/-54/+54 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; kg.-52/-57/-63/+63</p>\r\n<p>CADETTI/E B (U18) 16/17 anni &nbsp;kg. -53/-59/+59 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; kg.-61/-68/-76/+76</p>\r\n<p>JUNIOR (U21)&nbsp;18/20 anni &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;kg. -53/-60/+60 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; kg.-68/-78/+78</p>\r\n<p>SENIOR (+21)&nbsp;21/40 anni &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;kg. -55/-61/-68/+68 &nbsp; &nbsp;&nbsp;kg.-60/-67/-75/-84/+84</p>\r\n<p>LA GARA COSTITUIRA&rsquo; REQUISITO DI SELEZIONE PER PARTECIPARE ALLA COPPA EUROPA<br />WADOKAI CHE SI SVOLGERA&rsquo; IL 12 NOVEMBRE (SIGGENTHAL - SVIZZERA).</p>', 0, 'gara'),
(121, 'COPPA ITALIA RENGOKAI  - 2016 PALAFIAM Palestrina (RM)', '2016-10-16', NULL, '2016-10-07', 1, 0, 0, 3, 0, 0, 1500, 0, 0, 0, 0, 1, NULL, '<p><span><strong>COPPA ITALIA RENGOKAI&nbsp;</strong></span></p>\r\n<p><br />Si comunica che il giorno domenica 16 OTTOBRE 2016, presso il Palazzetto dello Sport &ndash;<br />PALAFIAM, sito in Via Pedemontana 223, 00036 Palestrina (RM) si svolger&agrave; la COPPA ITALIA<br />WADOKAI (specialit&agrave; kata e kumite individuale), COPPA ITALIA RENGOKAI (specialit&agrave; kata<br />interstile) e COPPA REGIONALE KATA (gara kata interstile categorie pre-agonisti e Over 40)</p>\r\n<p><br />Le iscrizioni, che dovranno essere effettuate utilizzando la modalit&agrave; online<br />sul sito http://www.fiamsport.it/gare, si chiuderanno Venerd&igrave; 7 ottobre alle ore 24.00.</p>\r\n<p>&nbsp;</p>\r\n<p>KATA (COPPA ITALIA RENGOKAI)&nbsp;VERDI/BLU - MARRON/NERE</p>\r\n<p>Regolamento &ldquo;WADOKAI EUROPE&rdquo; (WKF )-(sistema a bandierine)</p>\r\n<p>? Kata Tokui dello stile praticato.</p>\r\n<p>Verdi/Blu: non possono eseguire consecutivamente lo stesso kata</p>\r\n<p>Mar/Nere: non possono mai eseguire lo stesso kata</p>\r\n<p>&nbsp;</p>', 0, 'gara'),
(122, 'COPPA REGIONALE KATA PREAGONISTI e OVER40 - 2016 PALAFIAM Palestrina (RM)', '2016-10-16', NULL, '2016-10-07', 1, 0, 0, 3, 0, 0, 1500, 0, 0, 0, 0, 1, NULL, '<p><span><strong>COPPA REGIONALE KATA&nbsp;</strong></span></p>\r\n<p><br />Si comunica che il giorno domenica 16 OTTOBRE 2016, presso il Palazzetto dello Sport &ndash;<br />PALAFIAM, sito in Via Pedemontana 223, 00036 Palestrina (RM) si svolger&agrave; la COPPA ITALIA<br />WADOKAI (specialit&agrave; kata e kumite individuale), COPPA ITALIA RENGOKAI (specialit&agrave; kata<br />interstile) e COPPA REGIONALE KATA (gara kata interstile categorie pre-agonisti e Over 40)</p>\r\n<p><br />Le iscrizioni, che dovranno essere effettuate utilizzando la modalit&agrave; online<br />sul sito http://www.fiamsport.it/gare, si chiuderanno Venerd&igrave; 7 ottobre alle ore 24.00.</p>\r\n<p>COPPA REGIONALE KATA</p>\r\n<p>Gara Interstile &ndash; (sistema a bandierine)</p>\r\n<p>Per le seguenti categorie &egrave; prevista solo la gara di kata:</p>\r\n<p>Bambini Da 5 a 6 anni BIANCHE - GIALLE/ARANCIO - VERDE/BLU - MARRONI/NERE<br />Ragazzi 1 Da 7 a 8 anni BIANCHE - GIALLE/ARANCIO - VERDE/BLU - MARRONI/NERE<br />Ragazzi 2 Da 9 a 10 anni BIANCHE - GIALLE/ARANCIO - VERDE/BLU - MARRONI/NERE<br />Over 40 BIANCHE - GIALLE/ARANCIO - VERDE/BLU - MARRONI/NERE</p>\r\n<p>Elenco kata come da regolamento &ldquo;Unika&rdquo;</p>', 0, 'gara'),
(128, 'CAMPIONATO ITALIANO A SQUADRE AGONISTI', '2016-12-03', '2016-12-04', '2016-11-25', 1, 1, 0, 3, 0, 0, 1500, 4000, 0, 0, 1, 1, NULL, '<p><span style="font-size: small;"><strong>CAMPIONATO ITALIANO A SQUADRE AGONISTI</strong></span></p>\r\n<p><span style="font-size: small;"><strong>CAMPIONATO ITALIANO INDIVIDUALE E SQUADRE PRE-AGONISTI </strong></span></p>\r\n<p><span style="font-size: small;"><strong>CAMPIONATO ITALIANO INDIVIDUALE OVER 40</strong> </span><br /><span style="font-size: small;">&nbsp;</span><br /><span style="font-size: small;">Comunichiamo a tutti gli affiliati che nei giorni 3 e 4 dicembre P.V. presso il Palazzetto dello Sport </span><br /><span style="font-size: small;">di Cervia in via Pinarella 66 avr&agrave; luogo la gara in oggetto. </span><br /><span style="font-size: small;">&nbsp;</span><br /><span style="font-size: small;"><span style="text-decoration: underline;">PROGRAMMA SABATO 3 Dicembre SPECIALITA&rsquo; KATA&nbsp;</span> </span><br /><span style="font-size: small;">h. 12.30&nbsp;&nbsp; Ritrovo&nbsp; </span><br /><span style="font-size: small;">h. 13.30&nbsp; Saluto ed inizio gare di Kata Preagonisti a seguire gare over 40 e squadre. </span></p>\r\n<p><br /><span style="font-size: small;"><span style="text-decoration: underline;">PROGRAMMA DOMENICA 4 Dicembre SPECIALITA&rsquo; KUMITE&nbsp;</span> </span><br /><span style="font-size: small;">h. 08.00 &ndash; 08.30 Controllo iscrizioni e operazioni di peso a campione&nbsp; </span><br /><span style="font-size: small;">h. 08.30 Saluto ed inizio gare di Kumite Preagonisti a seguire gara over 40 e squadre.&nbsp; </span><br /><span style="font-size: small;">&nbsp;</span><br /><span style="font-size: small;">LA CHIUSURA DELLE ISCRIZIONI SAR&Agrave; <strong>VENERDI&rsquo; 25 NOVEMBRE 2016</strong>.&nbsp; </span><br /><span style="font-size: small;">DOPO LA MEZZANOTTE DI SUDDETTO GIORNO IL SISTEMA INFORMATICO DI GESTIONE GARA NON </span><br /><span style="font-size: small;">CONSENTIR&Agrave; PI&Ugrave; DI INSERIRE NUOVI ATLETI.&nbsp; </span><br /><span style="font-size: small;">LA QUOTA DI PARTECIPAZIONE &Egrave; DI &euro; 15,00 PER SPECIALIT&Agrave; INDIVIDUALE, &euro; 30,00 PER LE </span><br /><span style="font-size: small;">SQUADRE PREAGONISTI E &euro;40,00 PER LE SQUADRE AGONISTI</span></p>', 0, 'gara'),
