(153, 'Trofeo Liguria 2018', '2018-02-04', NULL, '2018-01-31', 1, 2, 0, 3, 0, 0, 1500, 3000, 0, 0, 1, 1, 'jpg', '<p><span style="font-size: small;">Si comunica che il giorno&nbsp;<strong>4 FEBBRAIO 2018</strong>, presso il palazzetto di Manesseno - S.Olcese via L.Sturzo n.80, si svolger&agrave; il&nbsp;<strong>TROFEO LIGURIA 2018</strong>, per Agonisti e Preagonisti &nbsp;Kata Ind.le e Squadre - Kumite Shobu Sanbon solo Ind.le, aperto a tutti gli Atleti maschi e femmine di ogni Federazione e Ente di Promozione</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong>PROGRAMMA</strong></span></p>\r\n<p><span style="font-size: small;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-size: small;"><strong>(PREAGONISTI)</strong></span></p>\r\n<p><span style="font-size: small;">Ore 8,00 controllo iscrizioni</span></p>\r\n<p><span style="font-size: small;">Ore 9,00 inizio gara categoria BAMBINI (5/7 anni) a seguire categorie RAGAZZI (8/13 ANNI)</span></p>\r\n<p><span style="font-size: small;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-size: small;"><strong>(AGONISTI)</strong></span></p>\r\n<p><span style="font-size: small;">Ore 11,00 controllo iscrizioni Agonisti</span></p>\r\n<p><span style="font-size: small;">Ore 11,30 circa inizio gara Agonisti</span></p>\r\n<p><span style="font-size: small;">Ore 17,00 previsione termine gara</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong>Ricordiamo alle federazioni esterne FIAM che nelle gare di Kumite Sanbon per le categorie Bambini, Ragazzi1 e Ragazzi2 &egrave; obbligatorio il caschetto mentre per la categoria Ragazzi3 non &egrave; permesso il caschetto ed &egrave; obbligatorio il paradenti.</strong></span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong>In deroga al regolamento verranno accettate protezioni di ogni colore.</strong></span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">La quota di partecipazione &egrave; di&nbsp;<strong>EURO 15.00</strong>&nbsp;per ogni gara individuale e di&nbsp;<strong>EURO 30.00&nbsp;</strong>a squadra</span></p>\r\n<p><span style="font-size: medium; background-color: #ffff00;"><strong>da versarsi direttamente sul luogo prima della gara.</strong></span></p>', 0, 'gara'),
(157, 'CERVIA - KATA RENGOKAI ', '2018-03-17', NULL, '2018-03-09', 1, 0, 0, 3, 0, 0, 1500, 0, 0, 6000, 1, 1, NULL, '<p><span style="font-size: medium;"><strong><span style="text-decoration: underline;">CHIUSURA ISCRIZIONI 9/03/2018</span></strong></span></p>\r\n<p><span style="color: #ff0000;"><strong><span style="font-size: x-large;"><span style="font-size: medium;">PROGRAMMA SABATO 17 marzo SPECIALITA&rsquo; KATA</span> </span></strong></span></p>\r\n<p>h. <span style="font-size: small;">13.00- 13.30 Ritrovo</span></p>\r\n<p><span style="font-size: small;">h. 14.30 Saluto ed inizio gare di Kata Preagonisti a seguire le altre categorie.</span></p>\r\n<p><span style="font-size: small;">h. 16.00 &ndash; 18.00 <strong>controllo peso per gli atleti presenti.</strong></span></p>\r\n<p><span style="font-size: small;">(Sar&agrave; ammesso un Kg e mezzo di tolleranza)</span></p>\r\n<p><span style="font-size: small;">h. 17.00 c.a Gara kata categoria diversamente abili.</span></p>\r\n<p><span style="color: #ff0000; font-size: medium;"><strong>PROGRAMMA DOMENICA 18 marzo SPECIALITA&rsquo; KUMITE</strong></span></p>\r\n<p><span style="font-size: small;">h. 07.00 Controllo iscrizioni</span></p>\r\n<p><span style="font-size: small;"><span style="font-family: Calibri,Calibri;"><span style="font-family: Calibri,Calibri;">h. 07.15-8.15 </span></span><strong>Controllo peso per tutti gli atleti. </strong></span></p>\r\n<p><span style="font-size: small;">(Sar&agrave; ammesso un Kg e mezzo di tolleranza)</span></p>\r\n<p><span style="font-size: small;">h. 08.45 Saluto ed inizio gare di Kumite Preagonisti a seguire le altre categorie</span></p>', 0, 'gara'),
(166, 'Coppa Italia RENGOKAI - San Benedetto del Tronto 14-15 aprile', '2018-04-14', '2018-04-15', '2018-04-06', 1, 0, 0, 3, 0, 0, 1500, 4500, 500, 2000, 1, 0, NULL, '<p><span style="color: #ff0000; font-family: ''arial black'', ''avant garde''; font-size: large;">Coppa Italia RENGOKAI - San Benedetto del Tronto 14-15 aprile</span></p>\r\n<p><span style="color: #000000; font-size: small; font-family: arial, helvetica, sans-serif;">il 14 e 15 APRILE, presso il Palazzetto dello Sport in Viale dello Sport a San Benedetto del Tronto (AP) si svolger&agrave; la COPPA ITALIA WADOKAI, torneo individuale e squadre di Kata di stile Wado ryu e Kumite individuale.</span><br /><span style="color: #000000; font-size: small; font-family: arial, helvetica, sans-serif;">Nella stessa occasione si svolger&agrave; la COPPA ITALIA RENGOKAI, torneo di kata interstile.</span><br /><span style="color: #000000; font-size: small; font-family: arial, helvetica, sans-serif;">Le modalit&agrave; di gara adottate faranno riferimento al regolamento della Coppa Europa Wadokai.</span></p>\r\n<p><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #ff0000;">PROGRAMMA</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #008000;">SABATO 14 APRILE</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #008000;">h. 14.00 Controllo iscrizioni</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #008000;">h. 14.30 Saluto di apertura ed inizio gara di kata (categorie pre-agonisti)</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #008000;">h. 17.00 Gara a squadre KATA</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #008000;">DOMENICA 15 APRILE</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #008000;">h. 07.45 -8.00 Controllo iscrizioni</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #008000;">h. 7.30 &ndash; 8.30 Controllo peso</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #008000;">h. 8.45 Saluto di apertura ed inizio gara di kumite.</span></p>', 0, 'gara'),
(165, 'Coppa Italia WADOKAI - San Benedetto del Tronto 14-15 aprile', '2018-04-14', '2018-04-15', '2018-04-06', 1, 2, 0, 3, 0, 0, 1500, 4500, 500, 6000, 1, 0, NULL, '<p><span style="color: #ff0000; font-size: large; font-family: ''arial black'', ''avant garde'';">Coppa Italia WADOKAI&nbsp; - San Benedetto del Tronto 14-15 aprile</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">il 14 e 15 APRILE, presso il Palazzetto dello Sport in Viale dello Sport a San Benedetto del Tronto (AP) si svolger&agrave; la COPPA ITALIA WADOKAI, torneo individuale e squadre di Kata di stile Wado ryu e Kumite individuale.</span><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Nella stessa occasione si svolger&agrave; la COPPA ITALIA RENGOKAI, torneo di kata interstile.</span><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Le modalit&agrave; di gara adottate faranno riferimento al regolamento della Coppa Europa Wadokai.</span></p>\r\n<p><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #ff0000;">PROGRAMMA</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #339966;">SABATO 14 APRILE</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #339966;">h. 14.00 Controllo iscrizioni</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #339966;">h. 14.30 Saluto di apertura ed inizio gara di kata (categorie pre-agonisti)</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #339966;">h. 17.00 Gara a squadre KATA</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #339966;">DOMENICA 15 APRILE</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #339966;">h. 07.45 -8.00 Controllo iscrizioni</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #339966;">h. 7.30 &ndash; 8.30 Controllo peso</span><br /><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #339966;">h. 8.45 Saluto di apertura ed inizio gara di kumite.</span></p>', 0, 'gara'),
