(175, 'Trofeo Sabbione 2018', '2018-10-21', NULL, '2018-10-17', 1, 0, 0, 3, 0, 0, 0, 10000, 500, 0, 1, 1, NULL, '<p>&nbsp;</p>\r\n<p>&ldquo;TROFEO SABBIONE "</p>\r\n<p>&nbsp;</p>\r\n<p>Aperta a tutte le societ&agrave; appartenenti a: <br /> FEDERAZIONI ed ENTI di PROMOZIONE SPORTIVA <br /> &ldquo; purch&eacute; in regola con i propri tesseramenti&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>KATA - KUMITE SHOBU SANBON (individuale) <br />Preagonisti e Agonisti - Maschile e Femminile</p>\r\n<p>&nbsp;</p>\r\n<p>Si comunica che il giorno 21 Ottobre 2018, presso il palazzetto di Vignole Borbera (AL) in <br />Largo S. Pertini, si svolger&agrave; il trofeo Sabbione rivolto a tutte le categorie sottoelencate.</p>\r\n<p>&nbsp;</p>\r\n<p>PROGRAMMA di GARA</p>\r\n<p>&nbsp;</p>\r\n<p>(PREAGONISTI) <br />Ore 08.30 verifica iscrizioni Preagonisti <br />Ore 09.00 inizio gara categorie Preagonisti dai 5 anni fino a 13 anni <br />(AGONISTI) <br />Ore 10.30 circa verifica iscrizioni Agonisti <br />Ore 11.30 circa inizio gara agonisti</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>REGOLAMENTO GARA FIAM</p>\r\n<p>&nbsp;</p>\r\n<p>Si ricorda che le protezione in deroga al regolamento FIAM possono essere anche colorate</p>\r\n<p>&nbsp;</p>\r\n<p>Kumite: <br />Cat. Ragazzi 1 e 2 obbligo guantini, caschetto, corpetto, parastinchi con parapiedi e conchiglia. <br />Cat. Ragazzi 3 obbligo guantini, corpetto, paradenti, parastichi con parapiedi, paraseno Femm. <br />conghiglia maschi.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: ''arial black'', ''avant garde''; font-size: medium; color: #888888; background-color: #ffff00;">N.B. La quota di partecipazione &egrave; di Euro 15,00 per una sola specialit&agrave; e Euro 20,00 per due specialit&agrave;</span></p>\r\n<p>&nbsp;</p>', 0, 'gara'),
(176, 'CAMPIONATO ITALIANO A SQUADRE AGONISTI E PREAGONISTI COPPA ITALIA INDIVIDUALE PRE-AGONISTI E OVER 40 - 2018', '2018-12-01', '2018-12-02', '2018-11-23', 1, 2, 0, 3, 0, 0, 1500, 4000, 500, 6000, 1, 1, NULL, '<p><span style="font-size: medium;"><strong>CAMPIONATO ITALIANO A SQUADRE AGONISTI E PREAGONISTI</strong></span><br /><span style="font-size: medium;"><strong>COPPA ITALIA INDIVIDUALE PRE-AGONISTI E OVER 40</strong></span></p>\r\n<p><br />&nbsp;1 e 2 dicembre presso il Palazzetto dello Sport di Cervia in via Pinarella 66</p>\r\n<p><strong>PROGRAMMA SABATO 1 Dicembre</strong></p>\r\n<p>SPECIALITA&rsquo; KATA (Individuale/squadre) h. 14.00 Controllo Iscrizioni h. 14.30 Saluto ed inizio gare Preagonisti e, a seguire over 40; squadre. h. 16.00 Controllo peso (Preagonisti - over 40)</p>\r\n<p><strong> PROGRAMMA DOMENICA 2 Dicembre </strong></p>\r\n<p>SPECIALITA&rsquo; KUMITE h. 08.00 &ndash; 08.30 Controllo iscrizioni- Controllo peso h. 08.30 Saluto ed inizio gare Preagonisti; over 40; squadre.</p>\r\n<p><span style="color: #ff0000;"> LA CHIUSURA DELLE ISCRIZIONI SAR&Agrave; VENERDI&rsquo; 23 NOVEMBRE 2018. </span></p>\r\n<p>LA QUOTA DI PARTECIPAZIONE &Egrave; DI &euro; 15,00 PER SPECIALIT&Agrave; INDIVIDUALE E &euro; 40,00 PER LE SQUADRE,</p>\r\n<p>DA VERSARE ESCLUSIVAMENTE TRAMITE BONIFICO BANCARIO</p>\r\n<p>CONTO CORRENTE INTESTATO A FIAM: Codice Iban:&nbsp;&nbsp;<span style="font-size: small; font-family: arial, helvetica, sans-serif;">IT 19 R 05034 03300 000000005372</span></p>\r\n<p>Causale: &ldquo;nome societ&agrave; CAMPIONATO ITALIANO A SQUADRE FIAM&rdquo; NON SI ACCETTANO PAGAMENTI IN LOCO</p>', 0, 'gara');
