(177, 'CAMPIONATO ITALIANO A SQUADRE MISTA KATA', '2018-12-01', '2018-12-02', '2018-11-23', 1, 1, 0, 3, 0, 0, 1500, 4000, 500, 2000, 1, 1, NULL, '<div class="dettaglioG">\r\n<p><span><strong>CAMPIONATO ITALIANO A SQUADRE AGONISTI E PREAGONISTI</strong></span><br /><span><strong>COPPA ITALIA INDIVIDUALE PRE-AGONISTI E OVER 40</strong></span></p>\r\n<p><br />&nbsp;1 e 2 dicembre presso il Palazzetto dello Sport di Cervia in via Pinarella 66</p>\r\n<p><strong>PROGRAMMA SABATO 1 Dicembre</strong></p>\r\n<p>SPECIALITA&rsquo; KATA (Individuale/squadre) h. 14.00 Controllo Iscrizioni h. 14.30 Saluto ed inizio gare Preagonisti e, a seguire over 40; squadre. h. 16.00 Controllo peso (Preagonisti - over 40)</p>\r\n<p><strong>PROGRAMMA DOMENICA 2 Dicembre</strong></p>\r\n<p>SPECIALITA&rsquo; KUMITE h. 08.00 &ndash; 08.30 Controllo iscrizioni- Controllo peso h. 08.30 Saluto ed inizio gare Preagonisti; over 40; squadre.</p>\r\n<p><span>LA CHIUSURA DELLE ISCRIZIONI SAR&Agrave; VENERDI&rsquo; 23 NOVEMBRE 2018.</span></p>\r\n<p>LA QUOTA DI PARTECIPAZIONE &Egrave; DI &euro; 15,00 PER SPECIALIT&Agrave; INDIVIDUALE E &euro; 40,00 PER LE SQUADRE,</p>\r\n<p>DA VERSARE ESCLUSIVAMENTE TRAMITE BONIFICO BANCARIO</p>\r\n<p>CONTO CORRENTE INTESTATO A FIAM: Codice Iban:&nbsp;&nbsp;<span>IT 19 R 05034 03300 000000005372</span></p>\r\n<p>Causale: &ldquo;nome societ&agrave; CAMPIONATO ITALIANO A SQUADRE FIAM&rdquo; NON SI ACCETTANO PAGAMENTI IN LOCO</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<p class="dettaglioG"><a href="modifica.php?id=176">Modifica gara</a></p>', 0, 'gara'),
(178, 'CAMPIONATO ITALIANO A SQUADRE AGONISTI MISTA KUMITE', '2018-12-01', '2018-12-02', '2018-11-23', 1, 1, 0, 3, 0, 0, 1500, 4000, 500, 2000, 1, 1, NULL, '<p><strong>CAMPIONATO ITALIANO A SQUADRE AGONISTI E PREAGONISTI</strong><br /><strong>COPPA ITALIA INDIVIDUALE PRE-AGONISTI E OVER 40</strong></p>\r\n<p><br />&nbsp;1 e 2 dicembre presso il Palazzetto dello Sport di Cervia in via Pinarella 66</p>\r\n<p><strong>PROGRAMMA SABATO 1 Dicembre</strong></p>\r\n<p>SPECIALITA&rsquo; KATA (Individuale/squadre) h. 14.00 Controllo Iscrizioni h. 14.30 Saluto ed inizio gare Preagonisti e, a seguire over 40; squadre. h. 16.00 Controllo peso (Preagonisti - over 40)</p>\r\n<p><strong>PROGRAMMA DOMENICA 2 Dicembre</strong></p>\r\n<p>SPECIALITA&rsquo; KUMITE h. 08.00 &ndash; 08.30 Controllo iscrizioni- Controllo peso h. 08.30 Saluto ed inizio gare Preagonisti; over 40; squadre.</p>\r\n<p>LA CHIUSURA DELLE ISCRIZIONI SAR&Agrave; VENERDI&rsquo; 23 NOVEMBRE 2018.</p>\r\n<p>LA QUOTA DI PARTECIPAZIONE &Egrave; DI &euro; 15,00 PER SPECIALIT&Agrave; INDIVIDUALE E &euro; 40,00 PER LE SQUADRE,</p>\r\n<p>DA VERSARE ESCLUSIVAMENTE TRAMITE BONIFICO BANCARIO</p>\r\n<p>CONTO CORRENTE INTESTATO A FIAM: Codice Iban:&nbsp;&nbsp;IT 19 R 05034 03300 000000005372</p>\r\n<p>Causale: &ldquo;nome societ&agrave; CAMPIONATO ITALIANO A SQUADRE FIAM&rdquo; NON SI ACCETTANO PAGAMENTI IN LOCO</p>', 0, 'gara'),
(179, 'Coppa Regionale Lazio 2019', '2019-01-20', NULL, '2019-01-12', 1, 0, 0, 3, 0, 0, 1500, 4500, 500, 6000, 1, 1, NULL, '<p><strong><span style="font-size: medium; color: #ff0000;">Coppa Regionale Lazio 2019</span></strong></p>\r\n<p><span style="font-size: small;">Domenica 20 Gennaio 2019, presso il Palatorrino, in via Fiume Giallo 47 Roma</span></p>\r\n<p><br />Aperto a tutte le Societ&agrave; appartenenti a : Federazioni e/o Enti di Promozione Sportiva.<br />Tutti gli iscritti non FIAM saranno accettati soltanto se in regola con il tesseramento dell&rsquo;anno in corso e previa presentazione di tesserino all&rsquo;atto dell&rsquo;iscrizione.<br /><br /></p>\r\n<p>Le iscrizioni si effettueranno esclusivamente con utilizzo della modalit&agrave; online;</p>\r\n<p>le iscrizioni si chiuderanno sabato&nbsp; 12 gennaio alle ore 24 ed eventuali problemi dovranno essere segnalati attraverso l&rsquo;apposita funzionalit&agrave;.</p>\r\n<p>La quota di partecipazione &egrave; di 15,00 euro per ognuna delle gare previste.</p>\r\n<p>Si avvisano tutti i responsabili tecnici e sociali che non verranno assolutamente accettate iscrizioni<br />sul posto.</p>\r\n<p><br />L&rsquo;importo definitivo dovr&agrave; essere versato con bonifico bancario seguendo le indicazioni riportate dal software<br />on line con causale &ldquo; Nome societ&agrave; &ndash; Trofeo Reg.Lazio 2019&rdquo;, prima del giorno della manifestazione.</p>\r\n<p>PROGRAMMA<br />h 07,30 &ndash; 08,00 Verifica tesserini assicurativi<br />h.07.30 &ndash; 08.30 Controllo peso pre-agonisti (a campione)<br />h.08.00 &ndash; 08.30 Controllo iscrizioni<br />h.08.45 Inizio gara kata pre agonisti<br />a seguire inizio gara di kumite pre agonisti ;<br />h.12.00 &ndash; 13.00 Controllo peso agonisti (a campione)<br />h.13.30 Inizio gara kata agonisti<br />a seguire inizio gara kumite agonisti<br />Per motivi di carattere organizzativo il Responsabile e il Coordinatore di gara si riservano di poter accorpare<br />alcune categorie di peso, rispettando il principio dell&rsquo;et&agrave; e del grado.<br />La categoria di appartenenza &egrave; determinata dall&rsquo;et&agrave; dell&rsquo;atleta il giorno della competizione.</p>', 0, 'gara'),
(180, 'TROFEO LIGURIA 2019', '2019-02-03', NULL, '2019-01-31', 1, 2, 0, 3, 0, 0, 1500, 3000, 0, 4000, 1, 1, 'jpg', '<p style="text-align: center;"><span style="color: #ff0000; font-size: medium;"><strong>GARA INTERREGIONALE CINTURE NERE E COLORATE</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000; font-size: medium;"><strong>KATA IND.LE E SQUADRE &ndash; KUMITE SHOBU SANBON IND.LE</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: small;">Si comunica che il giorno <span style="text-decoration: underline;"><strong>3 FEBBRAIO 2019</strong></span>, presso il <span style="text-decoration: underline;"><strong>palazzetto di Manesseno - S.Olcese via L.Sturzo n.80</strong></span>, si svolger&agrave; il <strong><span style="text-decoration: underline;">TROFEO LIGURIA 2019</span></strong>, per Agonisti e Preagonisti Kata Ind.le e Squadre - Kumite Shobu Sanbon solo Ind.le, aperto a tutti gli Atleti maschi e femmine di ogni Federazione e Ente di Promozione</span></p>\r\n<p><span style="text-decoration: underline;"><strong><span style="font-size: small;">PROGRAMMA&nbsp;</span></strong></span></p>\r\n<p><br /><span style="text-decoration: underline;"><em><strong><span style="font-size: small;">(PREAGONISTI) </span></strong></em></span></p>\r\n<ul>\r\n<li><span style="font-size: small;">Ore 8,00 controllo iscrizioni </span></li>\r\n<li><span style="font-size: small;">Ore 9,00 inizio gara categoria BAMBINI (5/7 anni) a seguire categorie RAGAZZI (8/13 ANNI)</span></li>\r\n</ul>\r\n<p><strong><em><span style="text-decoration: underline;"><span style="font-size: small;">(AGONISTI)</span></span></em></strong></p>\r\n<ul>\r\n<li><span style="font-size: small;">Ore 11,00 controllo iscrizioni Agonisti&nbsp;</span></li>\r\n<li><span style="font-size: small;">Ore 11,30 circa inizio gara Agonisti&nbsp;</span></li>\r\n<li><span style="font-size: small;">Ore 17,00 previsione termine gara</span></li>\r\n</ul>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="text-decoration: underline; background-color: #ffff99;"><span style="font-size: small;">Ricordiamo alle federazioni esterne FIAM che nelle gare di Kumite Sanbon per le categorie </span><span style="font-size: small;">Bambini, Ragazzi1 e Ragazzi2 &egrave; obbligatorio il caschetto mentre per la categoria Ragazzi3 </span><span style="font-size: small;">non &egrave; permesso il caschetto ed &egrave; obbligatorio il paradenti.</span></span></p>\r\n<p><em><span style="font-size: small;">In deroga al regolamento verranno accettate protezioni di ogni colore.</span></em></p>\r\n<p><em><span style="font-size: small;">&nbsp;</span></em></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: small;">La quota di partecipazione &egrave; di <span style="text-decoration: underline;"><strong>EURO 15.00 per ogni gara individuale</strong></span> e di <span style="text-decoration: underline;"><strong>EURO 30.00 a </strong></span></span><br /><span style="text-decoration: underline;"><strong><span style="font-size: small;">squadra.</span></strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: medium; color: #ff0000; background-color: #ffff99;">Il pagamento delle iscrizioni dovr&agrave; essere effettuato tramite bonifico bancario: </span><br /><span style="font-size: medium; color: #ff0000; background-color: #ffff99;">Intestazione: Centro Studi Karate Liguria Asd </span><br /><span style="font-size: medium; color: #ff0000; background-color: #ffff99;">IBAN: : IT46B0335901600100000133464 </span><br /><span style="font-size: medium; color: #ff0000; background-color: #ffff99;">Causale: &ldquo; TROFEO LIGURIA 2019 &rdquo;</span></p>\r\n<p><em><span style="font-size: small;">&nbsp;</span></em></p>', 0, 'gara'),
(181, 'CAMPIONATO ITALIANO 2019 - RENGOKAI + SANBON OPEN', '2019-03-16', '2019-03-17', '2019-03-08', 1, 0, 0, 3, 0, 0, 1500, 4500, 0, 0, 1, 1, NULL, '<p><span style="font-size: medium;">Comunichiamo a tutti gli affiliati che nei giorni 16 e 17 marzo P.V. presso il PalaTerme </span><br /><span style="font-size: medium;">via Cimabue, 50 a Montecatini Terme (PT) avr&agrave; luogo la gara in oggetto.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: small;"><span style="text-decoration: underline;"><strong>SHOBU SANBON OPEN</strong></span>: rivolta alle categorie Junior e Senior con il grado minimo di cintura blu, maschile e femminile.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="text-decoration: underline;">RENGOKAI (kata)</span></strong>: categorie Cadetti A/B, Junior/senior cinture marroni e nere maschile e femminile: Sistema a Bandierine con ripescaggio dai finalisti. Gli atleti dovranno cambiare il kata ad ogni turno.</span></p>', 0, 'gara'),
(184, 'COPPA ITALIA RENGOKAI  2019 - Vermicino (Roma) 14 aprile ', '2019-04-14', NULL, '2019-04-05', 1, 0, 0, 3, 0, 0, 1500, 4500, 0, 6000, 1, 0, NULL, '<p><span style="font-size: x-large; color: #339966;"><strong>COPPA ITALIA RENGOKAI</strong></span></p>\r\n<p><span style="font-size: medium;">Si comunica che il 14 APRILE, presso il Palazzetto dello Sport in Viale dello Sport di&nbsp;Vermicino in Via Luigi Einaudi 27 - 00044 Frascati, si svolger&agrave; laCOPPA ITALIA RENGOKAI, torneo di kata interstile.</span></p>\r\n<p><span style="font-size: small;">Nella stessa occasione si svolger&agrave; la&nbsp;COPPA ITALIA&nbsp;WADOKAI, torneo individuale di Kata di stile Wado Ryu e Kumite individuale.</span></p>\r\n<p><span style="font-size: medium;">Le modalit&agrave; di gara adottate faranno riferimento al regolamento della Coppa Europa&nbsp;</span><span style="font-size: medium;">Wadokai.</span></p>\r\n<p><span style="font-size: medium;">P</span><span style="font-size: medium;">er le categorie Cadetti A, Cadetti B, Junior e Senior &egrave; possibile iscriversi in entrambe le&nbsp;</span><span style="font-size: medium;">gare di kata (Wadokai e Rengokai)</span></p>\r\n<p><span style="color: #ff0000; font-size: medium;">Le iscrizioni, che dovranno essere effettuate utilizzando la modalit&agrave; online sul sito</span><br /><span style="color: #ff0000; font-size: medium;"><span style="color: #008080;">http://www.fiamsport.it/gare</span>, si chiuderanno Venerd&igrave; 5 aprile alle ore 24.00.</span></p>\r\n<p>Si potr&agrave; eseguire un kata a scelta a prescindere dallo stile.<br />CATEGORIE:<br />CAD A &ndash; CAD B &ndash; JUNIOR/SENIOR (18 &ndash; 40 anni)<br />CINTURE:<br />VERDI/BLU<br />MARRONI/NERE<br />Regolamento &ldquo;WADOKAI EUROPE&rdquo; sistema a bandierine<br />Verdi-Blu: non possono ripetere lo stesso kata, lo possono alternare a un altro, oppure<br />possono eseguire un kata diverso a ogni turno<br />Maroni-Nere: devono eseguire un kata diverso ad ogni turno</p>\r\n<p><span style="color: #ff0000; font-size: medium;">&nbsp;</span></p>\r\n<p><span style="font-size: medium; color: #ff0000;">&nbsp;</span></p>', 0, 'gara'),
(185, '    Coppa Italia Wadokai e Coppa Italia Preagonisti 2019 - Vermicino (Roma) 14 aprile', '2019-04-14', NULL, '2019-04-05', 1, 0, 0, 3, 0, 0, 1500, 4500, 0, 6000, 1, 0, NULL, '<p>&nbsp;</p>\r\n<p><strong><span style="text-decoration: underline;">COPPA ITALIA WADOKAI e COPPA ITALIA PREAGONISTI</span></strong></p>\r\n<p>Si comunica che il 14 APRILE, presso il Palazzetto dello Sport in Viale dello Sport di Vermicino in Via Luigi Einaudi 27 - 00044 Frascati, si svolger&agrave; la <strong>COPPA ITALIA WADOKAI</strong>, torneo individuale di Kata di stile Wado Ryu e Kumite individuale.</p>\r\n<p><strong><span style="text-decoration: underline;">L</span></strong><strong><span style="text-decoration: underline;">A GARA COSTITUIRA&rsquo; UNO DEI REQUISITI DI SELEZIONE PER PARTECIPARE ALLA COPPA EUROPA WADOKAI CHE SI SVOLGERA&rsquo; IL 2NOVEMBRE C.A. A BUDAPEST (Ungheria).</span></strong></p>\r\n<p><strong><span style="text-decoration: underline;">&nbsp;</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Nella stessa occasione si svolger&agrave; la <strong>COPPA ITALIA RENGOKAI</strong>, torneo di kata interstile. Le modalit&agrave; di gara adottate faranno riferimento al regolamento della Coppa Europa Wadokai.</p>\r\n<p>&nbsp;</p>\r\n<p>Le iscrizioni, che dovranno essere effettuate utilizzando la modalit&agrave; online sul sito <a href="../"><span style="text-decoration: underline;">htt</span><span style="text-decoration: underline;">p</span><span style="text-decoration: underline;">://www.fiamsport.it/gare</span>, s</a>i chiuderanno <strong><span style="text-decoration: underline;">Venerd&igrave; 5 aprile</span> </strong>alle ore 24.00.</p>\r\n<p>&nbsp;</p>\r\n<table border="1" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td valign="top" width="23">\r\n<p><strong>h</strong><strong>.</strong></p>\r\n</td>\r\n<td valign="top" width="81">\r\n<p><strong>&nbsp;08.</strong><strong>0</strong><strong>0</strong></p>\r\n</td>\r\n<td valign="top" width="551">\r\n<p><strong>C</strong><strong>o</strong><strong>n</strong><strong>trollo iscrizioni</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top" width="23">\r\n<p><strong>h</strong><strong>.</strong></p>\r\n</td>\r\n<td valign="top" width="81">\r\n<p><strong>&nbsp;08.</strong><strong>3</strong><strong>0</strong></p>\r\n</td>\r\n<td valign="top" width="551">\r\n<p><strong>S</strong><strong>aluto di apertura ed inizio gara di kata categorie preagonisti</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top" width="23">\r\n<p><strong>&nbsp;</strong></p>\r\n</td>\r\n<td valign="top" width="81">\r\n<p><strong>&nbsp;</strong></p>\r\n</td>\r\n<td valign="top" width="551">\r\n<p><strong>A seguire inizier&agrave; il torneo di Kumite</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong><span style="text-decoration: underline;">&nbsp;</span></strong></p>', 0, 'gara'),
(183, 'CAMPIONATO ITALIANO INDIVIDUALE 2019', '2019-03-16', '2019-03-17', '2019-03-08', 1, 0, 0, 3, 0, 0, 1500, 4500, 0, 0, 1, 1, NULL, '<p style="text-align: center;"><span style="font-size: medium;"><strong>CAMPIONATO ITALIANO INDIVIDUALE AGONISTI PRE-AGONISTI E OVER 40</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: small;">Comunichiamo a tutti gli affiliati che nei giorni 16 e 17 marzo P.V. presso il PalaTerme&nbsp;via Cimabue, 50 a Montecatini Terme (PT) avr&agrave; luogo la gara in oggetto.</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong>PROGRAMMA SABATO 16 marzo SPECIALITA&rsquo; KATA</strong>&nbsp;</span><br /><span style="font-size: small;">h. 13.00- 13.30 Ritrovo&nbsp;</span><br /><span style="font-size: small;">h. 14.30 Saluto ed inizio gare di Kata Preagonisti a seguire le altre categorie.&nbsp;</span><br /><span style="font-size: small;">h. 16.00 &ndash; 18.00 controllo peso per gli atleti presenti.&nbsp;</span><br /><span style="font-size: small;">(Sar&agrave; ammesso 1 Kg di tolleranza)</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong>PROGRAMMA DOMENICA 17 marzo SPECIALITA&rsquo; KUMITE</strong>&nbsp;</span><br /><span style="font-size: small;">h. 07.00 Controllo iscrizioni&nbsp;</span><br /><span style="font-size: small;">h. 07.15-8.15 Controllo peso per tutti gli atleti.&nbsp;</span><br /><span style="font-size: small;">(Sar&agrave; ammesso 1 Kg di tolleranza)&nbsp;</span><br /><span style="font-size: small;">h. 08.45 Saluto ed inizio gare di Kumite Preagonisti a seguire le altre categorie</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;"><em>REGOLAMENTO DI GARA E CATEGORIE come da REGOLAMENTO_FIAM_FEBB.2016&nbsp;</em></span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">LA GARA DI KATA CINTURE COLORATE ADOTTER&Agrave; IL SISTEMA A BANDIERINE CON&nbsp;RIPESCAGGIO DAI FINALISTI.</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">ATTENZIONE: GLI ATLEI CHE VERRANNO TROVATI FUORI PESO PER POTER ESSERE&nbsp;REINSERITI ALLA GARA, NELLA CATEGORIA APPROPRIATA, DOVRANNO RIPAGARE, IN&nbsp;LOCO, LA QUOTA DI ISCRIZIONE.</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">E&rsquo; prevista la premiazione di:</span></p>\r\n<p><span style="font-size: small;"><strong>SUPER CHAMPION</strong>&nbsp;maschile e femminile (Cadetti A/B;&nbsp;Junior/Senior;) che si determiner&agrave; dalla somma dei punteggi di classifica ottenuti in&nbsp;ognuna delle gare alle quali ogni atleta parteciper&agrave;.&nbsp;</span><br /><span style="font-size: small;"><strong>COPPA SUPER MASTER</strong>&nbsp;determinata dalla somma dei punteggi ottenuti nelle due&nbsp;specialit&agrave;.</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">LA QUOTA DI PARTECIPAZIONE &Egrave; DI &euro; 15,00 PER SPECIALIT&Agrave; DA VERSARE&nbsp;ESCLUSIVAMENTE TRAMITE BONIFICO BANCARIO SUL CONTO CORRENTE&nbsp;INTESTATO A FIAM:&nbsp;</span><br /><span style="font-size: small;">CODICE IBAN: IT 19 R 05034 03300 000000005372&nbsp;</span><br /><span style="font-size: small;">CAUSALE: &ldquo;nome societ&agrave; CAMPIONATO ITALIANO Cervia 16/17 marzo&rdquo;</span></p>\r\n<p><span style="font-size: small;"><em>NON SI ACCETTANO PAGAMENTI IN LOCO.</em></span></p>', 0, 'gara'),
(186, '1° OPEN CUP FIAM', '2019-05-12', NULL, '2019-05-08', 1, 0, 0, 3, 0, 0, 1500, 4500, 500, 6000, 1, 1, 'jpg', '<p style="text-align: center;"><span style="text-decoration: underline;"><span style="font-size: large;"><strong>OPEN FIAM CUP</strong></span></span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span style="font-size: small;">E&rsquo; con piacere che invitiamo tutte le societ&agrave; sportive alla&nbsp;<strong>1&deg; OPEN FIAM CUP</strong>.&nbsp;</span><br /><span style="font-size: small;">L&rsquo;evento Fiam si terr&agrave; presso il PALAFERROLI localit&agrave; Offia-San Bonifacio Verona il 12&nbsp;maggio 2019.&nbsp;</span><br /><span style="font-size: small;">La gara che si &egrave; posto l&rsquo;obiettivo di diventare un torneo di carattere nazionale ed&nbsp;Internazionale, costituir&agrave; il primo di una serie di eventi programmati per uno&nbsp;sviluppo territoriale di alto livello tecnico ed organizzativo. Un nuovo progetto, che&nbsp;intende creare l&rsquo;opportunit&agrave; di partecipare anche a coloro che non sono ancora&nbsp;tesserati FIAM a competizioni aperte a tutti.&nbsp;</span><br /><span style="font-size: small;"><em>Per i tesserati Fiam i risultati saranno registrati nel ranking Nazionale.</em></span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;"><em><strong>PROGRAMMA</strong></em></span></span></p>\r\n<p><span style="font-size: small;">h. 8.20-8.30 Ritrovo e controllo iscrizioni&nbsp;</span><br /><span style="font-size: small;">h. 8.40 Saluto ed inizio gare di Kata e kumite Preagonisti.&nbsp;</span><br /><span style="font-size: small;">h. 10.00 Controllo peso agonisti&nbsp;</span><br /><span style="font-size: small;">h. 11.00 inizio categorie agonisti</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small; background-color: #ffff99;"><strong>LA GARA DI KATA CINTURE COLORATE ADOTTER&Agrave; IL SISTEMA A&nbsp;BANDIERINE CON RIPESCAGGIO DAI FINALISTI MENTRE LA GARA CINTURE&nbsp;MARRONI/NERE CON SISTEMA A PUNTEGGIO.</strong></span></p>\r\n<p><span style="font-size: small;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-size: small;"><strong>PROTEZIONI OBBLIGATORIE:</strong>&nbsp;</span><br /><span style="font-size: small;">TUTTE LE CATEGORIE: GUANTINI, PARATIBIE E PARAPIEDE, PARADENTI, CONCHIGLIA PER&nbsp;UOMINI E PARASENO PER LE DONNE&nbsp;</span><br /><span style="font-size: small;">CATEGORIE DAI 12/13 ANNI: E&rsquo; OBBLIGATORIO IL CORPETTO&nbsp;</span><br /><span style="font-size: small;">CATEGORIA 10/11 ANNI: E&rsquo; OBBLIGATORI IL CORPETTO E IL CASCHETTO.&nbsp;</span><br /><span style="font-size: small;">Le Protezione devono essere preferibilmente bianche ma sono accettata anche rosse e blu.</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">LA QUOTA DI PARTECIPAZIONE &Egrave; DI &euro; 15,00 PER SPECIALIT&Agrave; DA VERSARE&nbsp;ESCLUSIVAMENTE TRAMITE BONIFICO BANCARIO SUL CONTO CORRENTE&nbsp;INTESTATO A FIAM:&nbsp;</span><br /><span style="font-size: small; background-color: #ffff99;"><strong>CODICE IBAN: IT 19 R 05034 03300 000000005372&nbsp;</strong></span><br /><span style="font-size: small; background-color: #ffff99;"><strong>CAUSALE: &ldquo;nome societ&agrave; 1&deg; OPEN CUP FIAM - VERONA 12 MAGGIO 2019&rdquo;</strong></span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><em><span style="text-decoration: underline;"><span style="font-size: small;"><strong>NON SI ACCETTANO PAGAMENTI IN LOCO.</strong></span></span></em></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>', 0, 'gara'),
