(7, 42, NULL, 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=53', '', 'BUONASERA, NON MI RISULTA NELL\\''ELENCO DEGLI ATLETI CHE POSSONO PARTECIPARE AL CAMPIONATO ASSOLUTO L\\''ATLETA BARONTINI CHIARA, CINTURA MARRONE.HO MODIFICATO IERI IL COLORE DELLA SUA CINTURA VISTO CHE ERA STATA TESSERATA NELL\\''ANNO 2011/2012 COME CINTURA NERA.COME POSSO FARE?GRAZIE BUONA GIORNATA. DOTT.SSA PANICHI RAMONA', '2012-10-28 15:11:23'),
(8, 83, NULL, 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=53', '', 'prova email 2', '2012-10-29 15:58:34'),
(13, 47, NULL, 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=53', '', 'L\\''atleta CONSOLI Paolo ha preso la cintura nera ai Campionati Italiani 2012... \\"gli atleti che hanno ottenuto il grado di 1° dan dal mese di Giugno, dovranno gareggiare nel Campionato assoluto cinture nere\\"... non posso modificare il grado per inserirlo nelle nere', '2012-11-05 18:34:58'),
(14, 42, NULL, 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=53', '', 'Non c\\''è + nell\\''elenco degli atleti per il campionato assoluto Laveneziana Lorenzo,cintuta nera ;risulta come coach invece il coach è Sostegni Enrico', '2012-11-05 20:31:35'),
(15, 53, NULL, 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=53', '', 'Non riesco a fare prendere dal sistema l\\''inserimento della categoria di gara,kumite o kata che sia.', '2012-11-05 21:11:53'),
(16, 115, NULL, 'http://www.fiamsport.it/gare/dettagli.php?id=54', '', 'Non mi apre il pdf comunicato gara (cliccandoci sopra non succede nulla).\\r\\nAprendo il modulo d\\''iscrizione ci sono solo i preagonisti, mancano gli agonisti.\\r\\nNon c\\''è il modulo d\\''iscrizione per le squadre.', '2012-11-06 08:14:30'),
(17, 124, NULL, 'http://www.fiamsport.it/gare/org/', '', 'ATTENZIONE! Società KOKORO KARATE PISTOIA non compare nell\\''elenco atleti per la gara LAVENEZIANA LORENZO che ho provveduto a modificare in cintura nera sia nel 2012 che nel 2013. \\nGrazie\\nBarbara', '2012-11-06 08:53:12'),
(18, NULL, NULL, 'http://www.fiamsport.it/gare/dettagli.php?id=54', '', 'prova vuota', '2012-11-06 10:33:05'),
