(20, 87, NULL, 'http://www.fiamsport.it/gare/resp/', '', 'prova errori resp', '2012-11-06 11:41:02'),
(21, 60, NULL, 'http://www.fiamsport.it/gare/soc/', '', 'l\\''atleta Chiappelli Rachele che ha vinto la cintura nera in gara non si puo inserire nella categoria propria\\ncadetti nere sanbon - 57  e cadetti kata nere. Si prega di insertire nella categoria giusta. Grazie', '2012-11-06 20:16:29'),
(22, 122, NULL, 'http://www.fiamsport.it/gare/org/riepilogo.php?id=53', '', 'Tondini GianLuca (master fitness) è iscritto nelle Femmine \\nLegge Christian (pol. COrassori) è nera', '2012-11-06 23:09:04'),
(23, 60, NULL, 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=53', '', 'Buongiorno purtroppo ci siamo accorti che Tondini Gianluca è stato inserito dal sistema con le femmine , si prega di correggere grazie', '2012-11-07 06:56:41'),
(24, 57, NULL, 'http://www.fiamsport.it/gare/soc/modsq.php?idg=54', '', 'ho inserito gara kata squadre. Premo il taso \\"+\\" atleta viene eliminato dalla lista. dopo aver inserito tutti e 3 gli atleti e fatto salve mi da errore \\"la squadra deve contenere 3 componenti\\". a parte l\\''errore il regolamento prevede anche di gareggiare con soli 2 atleti (ho 2 squadre così).\\r\\ngrazie x aiuto\\r\\nPaolo Gabbarini', '2012-11-07 07:24:33'),
(25, 122, NULL, 'http://www.fiamsport.it/gare/org/', '', 'Ciao Flavio nella palestra Ckoss l\\''atleta Meggetto Giada non è stata inserita perchè c\\''era un errore nella cintura ora è corretta, sarebbe da iscrivere alla gara di kumite come marrone kumite peso reale 60 KG grazie', '2012-11-07 17:49:10'),
(26, 87, NULL, 'http://www.fiamsport.it/gare/resp/riepilogo.php?id=53', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:16.0) Gecko/20100101 Firefox/16.0', 'prova nuova email', '2012-11-08 14:37:26'),
(27, 122, NULL, 'http://www.fiamsport.it/gare/org/riepilogo.php?id=53', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.11 (KHTML, like Gecko) Chrome/23.0.1271.64 Safari/537.11', 'Flavio non so se è la mia stampante ma mancano delle lettere e la stampa è tutta scombinata...prova a controllare ciao ciao', '2012-11-08 16:07:01'),
(28, 57, NULL, 'http://www.fiamsport.it/gare/soc/modsq.php?idg=54', 'Mozilla/5.0 (Windows NT 5.1; rv:15.0) Gecko/20100101 Firefox/15.0.1', 'con firefox funziona.\\nuletriori problemi:\\n- come si fanno prestiti?\\n- ho appena inserito 2 cadetti BLU ed un cadetto MARRONE e mi dice che non esiste gara. Dovrebbero invece fare cadetti MARRONE-NERA\\ngrazie di un pronto riscontro\\nPaolo Gabbarini\\nmushin.karate@libero.it', '2012-11-09 08:18:05'),
