(43, 56, NULL, 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=54', 'Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.11 (KHTML, like Gecko) Chrome/23.0.1271.64 Safari/537.11', 'qui al mushin abbiamo problemi con tre iscritti che per noi dovrebbero essere regolari.\\n\\nPuoi controllare i seguenti:\\n\\nNicole Selenati (Bianca --> Gialla 2012)\\nLuca Leoni (Arancio --> Verde 2012)\\nVincenzo Fini (Arancio --> Verde 2012)\\n\\nNon si riesce a capire il problema quando clicco sul link ( Atleta non verificato. Per ulteriori dettagli clicca qui) come esempio ti allego il file che mi da per Vincenzo Fini.\\n\\nIn occasione di una gara svolta a febbraio o marzo, Walter si ricorda che ti ha mandato l\\''iscrizione prorpio per questi tre mancanti, probabilmente per una dimenticanza in fase di rinnovo.', '2012-11-14 10:36:39'),
