(52, 83, 'kato68@alice.it', 'http://www.fiamsport.it/gare/soc/', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.11 (KHTML, like Gecko) Chrome/23.0.1271.64 Safari/537.11', 'Nell\\''iscrizione di una squadra di kata ,con una cintura blu e due marroni ,il programma mi segnala categoria inesistente,quando il regolamento della gara dice che una cintura blu può gareggiare anche con le marroni-nere.\\nHo cambiato il grado della blu in marrone per far accettare l\\''iscrizione della squadra ,ma è cambiata anche la categoria nll\\''individuale.\\nHo provato a modificare di nuovo il grado per ritornare al grado effettivo dell\\''atleta ma il programma non lo consente.\\nL\\''atleta in questione è Corallini Arianna e vorrei che fosse iscritta con il suo vero grado , cintura blu.', '2012-11-22 21:31:42'),
