(55, NULL, 'polisnts@libero.it', 'http://www.fiamsport.it/gare/soc/modsq.php?idg=56', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.11 (KHTML, like Gecko) Chrome/23.0.1271.64 Safari/537.11', 'nella schermata di iscrizione delle squadre nella lista degli atleti non compaiono i tecnici iscrivibili alla competizione, l\\''atleta Venturi non risulta iscrivibile mentre è invece regolarmente tesserata tutte le bambine appartenenti alla categoria gialle arancio -32 kg femminile kumite vengono automaticamente inserite con un peso di 44kg in ultimo non risulta tra i coach il direttore tecnico M° Cormio', '2012-11-28 09:50:18'),
(56, 128, 'polisnts@libero.it', 'http://www.fiamsport.it/gare/soc/iscrivisq.php?id=56', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.11 (KHTML, like Gecko) Chrome/23.0.1271.91 Safari/537.11', 'nonostante l\\''affiliazio sia completata e perfezionata il sistema non mi consente di iscrivere alla gara di kumite a squadre i tecnici salvati manolo e burgio francesco, inoltre non compare il nome del maestro e direttore tecnico cormio lino tra i coach', '2012-11-29 07:35:18'),
(57, 128, 'polisnts@libero.it', 'http://www.fiamsport.it/gare/soc/iscrivisq.php?id=56', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.11 (KHTML, like Gecko) Chrome/23.0.1271.91 Safari/537.11', 'ho già segnalato questa mattina e ieri sera che pur avendo regolarmente tesserato come tecnici nello specifico istruttore salvati manolo e allenatore burgio francesco non risultano nella lista degli atleti iscrivibili al campionato italiano a squadre cinture nere, chiedo pertanto un cortese cenno di riscontro con la consentita urgenz in quanto il termine ultimo per effettuare le iscrizioni è ormai prossimo', '2012-11-29 16:15:28'),
(58, 60, 'info@masterfitness.it', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=56', 'Mozilla/5.0 (Windows NT 6.1; rv:16.0) Gecko/20100101 Firefox/16.0', 'Ho contattato la segreteria gli atleti sono tutti attivi, ma risultano ancora in rosso nelle iscrizioni e non riesco ad inserirli in gara i nominativi sono nell\\''individuale : Baggiani Filippo - Ballati Niccolo - Belotti arianna - calvani jacopo - ferri jaessica - fornaro evita - fornaro thomas -franceschini manuele - giusti pietro -iannuzzi gabriele - lombardi giacomo -lombardi federico - mula jonathan - salvini lorenzo - trovatelli alessandro - trovatelli irene - vannucci lapo - vannucci niccolo . Nelle squadre : fanelli federico - pezzini emiliano - cusano luca. NON risulta presente in entrambi Iannuzzi Federico.\\nSaluti e Grazie\\nMarco', '2012-11-30 11:20:14'),
(59, 100, 'asdorizzonte1@gmail.com', 'http://www.fiamsport.it/gare/soc/', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.0; Trident/5.0)', 'D\\''AMICO GIANLUCA nato a CT il 14/09/1999 è regolarmente tesserato per l\\''anno in corso, ma non risulta nella lista atleti dell\\''ASD ORIZZONTE1.', '2012-11-30 14:15:59'),
(60, 100, 'asdorizzonte1@gmail.com', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=56', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.0; Trident/5.0)', 'D\\''amico Gianluca nato a Catania il 14/09/1999 e\\'' regolarmente tesserato per l\\''anno in corso ma non risulta nella lista atleti(come preagonista) per la gara di Montecatini.', '2012-11-30 14:26:32'),
(61, 60, 'info@masterfitness.it', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=56', 'Mozilla/5.0 (Windows NT 6.1; rv:16.0) Gecko/20100101 Firefox/16.0', 'Ho parlato con Barbara,lei ha controllato gli atleti e in segreteria è tutto ok.\\nGli atleti sono presentialla voce coach nelle cinture nere e tra gli altri tesserati ma mancano nell\\''elenco gara di gara.quindi non possiamo inserirli nell\\''individuale e neanche nella squadra.\\nse possibile risolvere visto che l\\''iscrizione scade domenica.\\nGrazie 1000', '2012-11-30 14:51:34'),
