(65, 42, 'esostegni@yahoo.it', 'http://www.fiamsport.it/gare/soc/riepilogosq.php?id=56', 'Mozilla/5.0 (Windows NT 5.1; rv:16.0) Gecko/20100101 Firefox/16.0', 'HO LETTO LA MAIL CHE MI AVETE INVIATO IN CUI VENIVA COMUNICATO CHE IL PROBLEMA DELLA DATA DI NASCITA DI BARONTINI CHIARA ERA STATO RISOLTO. E\\'' ANCORA SBAGLIATA .L\\''ATLETA E\\'' NATA IL 14/07/1997 E NON  IL 14/01/1997 COME SOTTO RIPORTATO.CORDIALI SALUTI.IL PRESIDENTE PANICHI RAMONA', '2012-12-01 14:59:42'),
