(67, 53, 'info@renbukan-dojo.it', 'http://www.fiamsport.it/gare/soc/riepilogosq.php?id=56', 'Mozilla/5.0 (Windows NT 6.1; rv:16.0) Gecko/20100101 Firefox/16.0', 'Abbiamo corretto la Squadra 4-Kumite ed adesso va bene-\\nResta da inserire la Squadra 5-Kata--Ragazzi 1-cpn Larissa Sarri-Alice Ugolini e Giulia Bindi.\\nDa aggiungere Andrea Viviani alla Squadra3-Kumite.', '2012-12-01 20:43:22'),
