(141, 48, 'saitta.domenico@libero.it', 'http://www.fiamsport.it/gare/dettagli.php?id=70', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/32.0.1700.76 Safari/537.36', 'Franceschini Matteo pur rientrando nella categoria preagonisti, risulta in rosso per cui non me lo fa\\'' aggiungere alla lista dei partecipanti al Trofeo Vicomandi,si prega di inserirlo d\\''ufficio in quanto domani scadono i termini di iscrizione. Grazie Saitta domenico', '2014-01-30 14:42:10'),
