(143, 59, 'enzo.collamati@teletu.it', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=71', 'Mozilla/5.0 (Windows NT 6.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/32.0.1700.76 Safari/537.36', 'non si riesce ad iscrivere alla gara Carboni Barbara per la quale il tesseramento è stato effettuato. La ragazza doveva essere iscritta per la gara di Kata. Prego di comunicare con Enzo Collamati o Natalia Piraino. Grazie.', '2014-01-31 21:22:48'),
(144, 59, 'enzo.collamati@teletu.it', 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=71', 'Mozilla/5.0 (Windows NT 6.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/32.0.1700.76 Safari/537.36', 'non si riesce ad iscrivere alla gara di kata Carboni Barbara anche se è stata regolarmente tesserata. Prego contattare Enzo Collamati o Natalia Piraino tel 335 5879608 mail cirina66@yahoo.it- Grazie', '2014-01-31 21:36:05'),
(145, 131, 'corsi@forumroma.it', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=71', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/32.0.1700.102 Safari/537.36', 'Non mi permette di segnare Fatello Ilaria nel kumite', '2014-02-03 11:59:28'),
(146, 47, 'karatefrascati@tiscali.it', 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=70', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:26.0) Gecko/20100101 Firefox/26.0', 'Morganti Riccardo, non potendo più arrivare in tempo per la gara di kata, farà solo quella di Kumite... grazie', '2014-02-04 11:46:26'),
(147, 47, 'karatefrascati@tiscali.it', 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=71', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:26.0) Gecko/20100101 Firefox/26.0', 'il sistema non accettandomi le bianche kumite, avevo chiesto in una precedende segnalazione di inserire:\\n- Rehl Sofia kg. 52\\n- D\\''Amici Riccardo kg. 61', '2014-02-04 13:00:05'),
(148, 47, 'karatefrascati@tiscali.it', 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=71', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:26.0) Gecko/20100101 Firefox/26.0', 'Spiridigliozzi Davide M 28/01/2000... ci siamo accorti di aver sbagliato il mese di nascita nel tesserarlo. Davide è nato il 28/07/2000 e quindi dovrà essere inserito nei preagonisti... con le mie scuse... grazie', '2014-02-04 21:12:55'),
(149, 48, 'saitta.domenico@libero.it', 'http://www.fiamsport.it/gare/soc/riepilogo_completo.php?id=70', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/32.0.1700.102 Safari/537.36', 'Come piu\\''volte comunicato,l\\''atleta Franceschini Matteo anno 2004 (Edera)non e\\'' stato inserito  alla gara Memorial Vicomandi (categotia kata gialle arancioni) per un errore da imputare al sistema informatico.Pertanto  lo ritengo iscritto a tutti gli effetti quindi Vi prego di provvedere al piu\\'' presto in tal senso.Saitta Domenico', '2014-02-04 21:33:57'),
(150, 134, 'maestro@dojosanpaolo.it', 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=71', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:9.0.1) Gecko/20100101 Firefox/9.0.1', 'L\\'' atleta Dondi Pietro, nato il 1/7/98, categoria 004- Kata Cadetti A Maschile Verde-Blu, l\\''ho erroneamente inserito come Cintura Verde, ma in realtà è una Cintura Blu. Ho provveduto alla correzione nell\\'' area Tessaramenti/Atleti. \\nScusandomi per il mio errore e sperando che si possa correggere in questa lista gare, senza creare troppi disagi,invio i miei più cordiali saluti.\\nOss,\\nMarco Gallai', '2014-02-05 00:17:55'),
(151, 131, 'corsi@forumroma.it', 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=71', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/32.0.1700.107 Safari/537.36', 'Avevo segnalato l\\''impossibilità di inserire Fatello Ilaria alla gara di kumite vedo che non è stato risolto... come mai? non c\\''è la categoria? Roberta Belelli 3385068206', '2014-02-05 10:21:39'),
(152, 59, 'enzo.collamati@gmail.com', 'http://www.fiamsport.it/gare/soc/riepilogo_completo.php?id=71', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/534.30 (KHTML, like Gecko) Chrome/12.0.742.112 Safari/534.30', 'Buongiorno,\\nvi prego di cancellare Yuri Bregoli dalla gara Se ka perchè per motivi familiari non potrà partecipare. Grazie', '2014-02-06 07:59:59'),
(153, 59, 'enzo.collamati@teletu.it', 'http://www.fiamsport.it/gare/soc/riepilogo_completo.php?id=71', 'Mozilla/5.0 (Windows NT 6.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/32.0.1700.102 Safari/537.36', 'comunico che l\\''atleta Alcamo Giorgia non potrà partecipare alla gara', '2014-02-07 20:49:46'),
(154, 118, 'r.debene@gmail.com', 'http://www.fiamsport.it/gare/dettagli.php?id=72', 'Mozilla/5.0 (Windows NT 6.3; WOW64; rv:26.0) Gecko/20100101 Firefox/26.0', 'Salve controllando la gara del piemonte ho notato che nelle categorie del kumite agonisti non sono inserite le cinture bianche creando dei problemi alla gara del lazio. essendo mancanti già dalla generazione iniziale dovremo prevederle in maniera permanente. altro problema è che nello scarico del file da inserire nel programma della gara (SET) l\\''eta dei prtecipanti deve essere aumentata di 1 anno in quanto il programma prevede eta non più utile e non eta minima ed eta massima, esmpio categoria RAGAZZI 2 va da 10 a 11 anni nel programma si deve inserire da 10 anni a 12 anni troppo vecchio << (78, \\''014 - Kata Ragazzi 2 Maschile Bianca\\'', 10, 11, \\''m\\'', \\''\\'', 1, 1), >> pertanto nella riga del file sql deve essere inserito 10, 12 e cosi per tutte le altre categorie. per altri chiarimenti puoi chiamarmi o sentire Flavio', '2014-02-11 22:41:23'),
(155, 118, 'r.debene@gmail.com', 'http://www.fiamsport.it/gare/resp/', 'Mozilla/5.0 (Windows NT 6.3; WOW64; rv:27.0) Gecko/20100101 Firefox/27.0', 'puoi cancellare le due gare di prova che sono state inserite erroneamente grazie Riccardo', '2014-02-24 18:29:35'),
(156, 118, 'r.debene@gmail.com', 'http://www.fiamsport.it/gare/dettagli.php?id=75', 'Mozilla/5.0 (Windows NT 6.3; WOW64; rv:27.0) Gecko/20100101 Firefox/27.0', 'controllando tutte le categorie mancano nel kumite sanbon le cinture bianche dei juniores - seniores e over 40 maschile e femminile. devono essere inserite in maniera definitiva anche in prospettiva del campionato italiano grazie Riccardo', '2014-02-24 18:37:33'),
(157, 131, 'corsi@forumroma.it', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=75', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/33.0.1750.117 Safari/537.36', 'Buongiorno, Ho 2 ragazzi che Barbara ancora non ha sbloccato... Gli ho mandato sabato il bonifico ma si vede che non lo ha visto. Le ho lasciato un messaggio sul cell. temo che non faccia in tempo per stasera.. si possono tenere in sospeso? sono Da Milano Francesco e Lodico Francesco che fanno solo kata. Roberta Belelli', '2014-03-03 11:51:39'),
(158, 59, 'enzo.collamati@teletu.it', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=75', 'Mozilla/5.0 (Windows NT 6.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/33.0.1750.117 Safari/537.36', 'non riesco ad inserire Di Franco Giulio nella gara di kata cinture bianche esordiente poichè è stato eseguito oggi il tesseramento.Vi prego di inserirlo. Il regolamento è stato eseguito oggi stesso. Grazie', '2014-03-03 21:04:05'),
(159, 63, 'sabrysan@hotmail.com', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=75', 'Mozilla/5.0 (iPad; CPU OS 7_0_6 like Mac OS X) AppleWebKit/537.51.1 (KHTML, like Gecko) Version/7.0 Mobile/11B651 Safari/9537.53', 'Non mi é ancora possibile iscrivere Paolo Calzone (kata) e Federico Spiezia (kata e kumite 78 kg), ma ho inviato iscrizione e pagamento entro la scorsa settimana.', '2014-03-03 21:42:45'),
(160, 153, 'gainko@gmail.com', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=75', 'Mozilla/5.0 (Windows NT 6.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/33.0.1750.117 Safari/537.36', 'non si riesce ad inserire i coach quindi comunico che i nostri sono Salvatore Mennella, Simone Mercuri, Marisa Boncoraglio distinti saluti Perilli Giancarlo', '2014-03-03 22:13:32'),
(161, 59, 'enzo.collamati@gmail.com', 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=75', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/33.0.1750.146 Safari/537.36', 'Buongiorno, avevo chiesto ieri di poter iscrivere Di Franco Giulio alla gara di kata cinture bianche esordienti, ma non lo vedo ancora iscritto.Posso avere informazioni? Grazie', '2014-03-04 12:33:31'),
(162, NULL, 'okinawasportingclub@tiscali.it', 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=75', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/33.0.1750.146 Safari/537.36', 'devo togliere dalla lista iscrizione gare l\\''atleta Calisti  Nicolo sia per la gara di kata che in quella di kumite ...motivo malattia ...grazie', '2014-03-07 17:00:21'),
(163, 63, 'sabrysan@hotmail.com', 'http://www.fiamsport.it/gare/soc/riepilogo_completo.php?id=75#cat625', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/33.0.1750.146 Safari/537.36', 'Possiamo attenerci ai tabelloni? Perché non combaciano con i dati che trovo nel \\"riepilogo individuali\\". Non riesco a trovare l\\''atleta Federico Spiezia che era categoria 220 (era l\\''unico quindi deve essere stato accorpato ma non riesco a trovare dove).', '2014-03-08 12:03:48'),
(164, 42, 'esostegni@yahoo.it', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=77', 'Mozilla/5.0 (Windows NT 5.1; rv:27.0) Gecko/20100101 Firefox/27.0', 'BUONGIORNO, DEVO MODIFICARE LA DATA DI NASCITA DI BARONTINI CHIARA , MA NON MI RIESCE.L\\''ATLETA  E\\'' NATA IL 14/07/1997 E NON IL 14/01/1997....GRAZIE..ENRICO', '2014-03-08 16:20:44'),
(165, 142, 'centroshotokankarate@hotmail.it', 'http://www.fiamsport.it/gare/dettagli.php?id=75', 'Mozilla/5.0 (Windows NT 6.1; WOW64; Trident/7.0; rv:11.0) like Gecko', 'ciao Riccardo ecco: gara 017 kata M/N non trovo tabulato gara,gara 141 kata over 40 M/N non trovo tabulato di gara,gara 003 kata bambini mas./fem. giallo/arancio Pool 1 nell\\''elenco  c\\''è Baldazzi Lina mentre nel tabulato gara è Pool 2 come me lo spieghi e nel Time Table come la trovo se non sono sicura della Pool?, gara 015 ragazzi 2 mas. gialla-arancio Pool 2 nell\\''elenco Giuliano Guido mentre nel tabulato gara è Pool 1 dove lo trovo nel Time Table se le Pool non corrispondono?,gara 015 mas.g/A.Pool 1 nell\\''elenco Oliva Andrea mentre nel tabulato gara è Pool 2 quindi stesso discorso degli altri,gara 002 kata bambini M/F Bianca Pool 1 nell\\''elenco Luciani Mario mentre nel tabulato gara è Pool 3 vale lo stesso discorso di sopra.Per quanto riguarda la gara 064 e 065 sambon ragazzi marrone-nera non ho avuto più notizie di accorpamento con altra categoria.fammi sapere.grazie', '2014-03-08 16:51:31'),
(166, 54, 'okinawasportingclub@tiscali.it', 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=75', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/33.0.1750.146 Safari/537.36', 'devo togliere dalla lista ..riepilogo idividuali l\\''atleta Calisti Nicolo sia per la gara di kata che quella di kumite è ammalato e non puo partecipare grazi...', '2014-03-08 17:21:34'),
(167, 145, 'r.debene@gmail.com', 'http://www.fiamsport.it/gare/soc/index.php', 'Mozilla/5.0 (Windows NT 6.3; WOW64; rv:27.0) Gecko/20100101 Firefox/27.0', 'scusa augusto mi puoi togliere la gara di prova creata da modena grazie', '2014-03-11 21:02:06'),
(168, 131, 'corsi@forumroma.it', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=78', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/33.0.1750.146 Safari/537.36', 'Buongiorno, nella casella degli arbitri del Forum c\\''è Linari Alessandro, che non è tesserato con Forum, e non ci sono io Roberta Belelli. sono stata convocata e quindi avrei dovuto trovare il mio nome... giusto?', '2014-03-28 01:15:41'),
(169, 127, 'pamkarate@libero.it', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=78', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/33.0.1750.154 Safari/537.36', 'Buongiorno, verificando i nomi degli ufficiali di gara da confermare per il campionato italiano, come da convocazioni ricevute, ho scoperto che tra gli arbitri c\\''è un solo nominativo (Linari Alessandro), di persona non tesserata con la nostra società, mentre mancano completamente i quattro Ufficiali di Gara regolarmente tesserati. Cordiali saluti', '2014-03-31 09:51:02'),
