(185, 145, 'r.debene@gmail.com', 'http://www.fiamsport.it/gare/soc/index.php', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:33.0) Gecko/20100101 Firefox/33.0', 'Ciao Agusto sono Riccardo e ci dobbiamo sentire per il problema degli uffuciali di gara che puoi inserire solo tu. non so quando vedrai questo avviso io appena posso ne parlo con Francesca. la soluzione sarebbe di dare la possibilità di inserirli agli organizzatori.', '2014-11-15 10:18:08'),
(186, 144, 'r.debene@gmail.com', 'http://www.fiamsport.it/gare/org/index.php', 'Mozilla/5.0 (Windows NT 6.3; WOW64; rv:33.0) Gecko/20100101 Firefox/33.0', 'ho inserito tutti gli UDG ma c\\''è qualcosa che non quadra: 1) nella gara agonisti a squadre non appare il numero di UDG iscritti nelle singole società- 2) nella gara preagonisti risultano ma non scale la quota indicata - 3) dovrebbero apparire anche le società con gli UDG convocati ma privi di atleti altrimenti non posso controllare se sono stati tutti inseriti ed anche per i conti finali della segreteria. Ci sentiamo Riccardo', '2014-11-26 14:02:39'),
