(188, 144, 'r.debene@gmail.com', 'http://www.fiamsport.it/gare/org/riepilogo_soc.php?id=85', 'Mozilla/5.0 (Windows NT 6.3; WOW64; rv:33.0) Gecko/20100101 Firefox/33.0', 'ulteriore rettifica- oggi sono fuori forma- mi ero scordato che le società devono confermare la presenza allora annullo tutto quello che ho scritto prima ma bisogna mettere come confermati di default nel momento che il responsabile iscrive gli UDG e poi nel caso di non conferma togliere il fleg ed inviare una email alla segreteria dell\\''avvenuta cancellazione. mi sa che è meglio che ci sentiamo anche per telefono cosi non scrivo altre inesattezze. Ciao e scusami di nuovo Riccardo', '2014-11-26 14:16:52'),
(189, 145, 'r.debene@gmail.com', 'http://www.fiamsport.it/gare/soc/riepilogosq.php?id=85', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/39.0.2171.65 Safari/537.36', 'non sono sicuro ma mi sembra che detrae la quota UDG 2 volte. anche se indicato in più parti la quota di defalcare rimane solo una quella indicata in fase di generazione gara.', '2014-11-27 20:38:32'),
