(216, 145, 'r.debene@gmail.com', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=89', 'Mozilla/5.0 (compatible; MSIE 10.0; Windows NT 6.1; Trident/6.0)', 'nelle gare UNIKA per la categoria IPPON per regolamento è prevista la partecipazione delle cinture BLU. con la simulazione fatta sulla mia società il pulsante d\\''iscrizione si attiva ma se iscrivo l\\''atleta mi segnale che non esiste la categoria. nel regolamento FIAM le BLU non sono previste in quanto appartenenti ad un circuito diverso (campionato italiano cinture colorate)', '2015-04-14 09:25:10'),
