(219, 189, 'renshi@libero.it', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=89', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0; NecRecRec)', 'CHIEDO SCUSA. DA RITENERE NULLA LA PRECEDENTE SEGNALAZIONE!!! GRAZIE', '2015-04-24 07:41:40'),
(220, 185, 'csksfujiyama@libero.it', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=89', 'Mozilla/5.0 (Windows NT 6.1; Trident/7.0; NecRecRec; rv:11.0) like Gecko', 'come già segnalato l\\''atleta del csks Fujiyama Genazzano è stata erroneamente inserita nella categoria seniores femminile kata shotokan e Kumite ippon.  vargiu michela dovrà essere inserita correttamente nella categoria juniores femminile kata  shotokan e Kumite ippon in quanto è nata il 12.06.1994.', '2015-04-24 08:30:06'),
(221, 153, 'gainko@gmail.com', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=89', 'Mozilla/5.0 (Windows NT 6.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/42.0.2311.90 Safari/537.36', 'faccio presente che ho per la gara di kata deve essere inserita  crocicchia roberta bianca over 40 lunedi mattina seguira\\'' bonifico tesseramento e quota gara grazie per l\\''attenzione mi scuso per il disagio creato PERILLI GIANCARLO', '2015-04-26 18:53:23'),
(222, 118, 'r.debene@gmail.com', 'http://www.fiamsport.it/gare/resp/stat.php?id=89', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/41.0.2272.118 Safari/537.36', 'non essendo possibile alle società esterne modificare i dati degli atleti dopo la conferma lo potresti fare tu anche perché è una società che nel Lazio partecipa anche alle gare FIAM - la società è csksk fujiyama genazzano e l\\''atleta è VARGIU MICHELA NATA IL 12.06.1994 (è stato sbagliato l\\''anno di nascita pertanto cambia di categoria).\\ngrazie', '2015-04-26 21:51:46'),
(223, 33, 'manueleiacobucci@libero.it', 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=89', 'Mozilla/5.0 (Windows NT 5.1; rv:15.0) Gecko/20100101 Firefox/15.0.1', 'si chiede inserimento per MIREA SPARTA (BIANCA-KATA)e TANTILLO STEFANO (ARANCIONE-KATA). Inoltre attendiamo risposta sulla possibilità di far gareggiare PAVEL ANDREEA (KATA-BIANCA) in quanto non cittadina italiana. Grazie', '2015-04-27 18:38:27'),
(224, 195, 'ferrdomenico@inwind.it', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=89', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/42.0.2311.90 Safari/537.36', 'l\\''Atleta Venitelli il cognome è errato il reale cognome è venittelli Gabriel', '2015-04-27 20:12:33'),
(225, 153, 'gainko@gmail.com', 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=89', 'Mozilla/5.0 (Windows NT 6.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/42.0.2311.90 Safari/537.36', 'vi comunico che l\\''atleta Luca Fracassa e\\'' stato inserito nella categoria senior anziche\\'' in quella degli over 40 malgrado li abbia gia\\'' compiuti inoltre vi informo che lo stesso errore e\\'' stato fatto in quel di Riccione e dopo attenta riflessione con il Presidente,il consigliere Sig. Negrini e la Sig. Frate si venuti allo spostamento dell\\'' atleta Fracassa nella categoria over 40. Quindi vi prego cortesemente di chiarire il fatto per far si che non si debba poi discutere di nuovo in sede di gara. Mi scuso per la richiesta che ha me sembra comunque ovvia perdonatemi la franchezza (si e\\''maggiorenni a 17 anni e 365 giorni o a 18 anni e 365).BUON LAVORO', '2015-04-28 13:04:10'),
(226, 185, 'csksfujiyama@libero.it', 'http://www.fiamsport.it/gare/soc/riepilogo_completo.php?id=89#cat893', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729)', 'de martino andrea   csks fujiyama genazzano M 23/11/1995 Nera 77 Kg deve essere inserito nella     categoria -80 kg e non + 80 categoria seniores nera(già accorpato dall\\''ippon)', '2015-04-29 21:08:05'),
(227, 144, 'r.debene@gmail.com', 'http://www.fiamsport.it/gare/dettagli.php?id=89', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/42.0.2311.90 Safari/537.36', 'mi sono accorto che l\\''evento dopo la chiusura delle iscrizioni sparisce dal sito. chiedi a bruno se è il caso di lasciarlo fino al giorno della gara ed eventualmente anche per una settimana dopo. Come è adesso per poter vedere i dati bisogna loggarsi se invece rimane i tabbeloni ed i risultati vengono visti da tutti', '2015-04-30 07:40:42'),
(228, 115, 'danielepernino@yahoo.it', 'http://www.fiamsport.it/gare/dettagli.php?id=89', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/42.0.2311.90 Safari/537.36', 'Salve,\\nChiedo scusa a chi mi devo rivolgere per informazioni sugli accorpamenti? posso avere recapiti (telefono e/o e-mail)?\\nGrazie, buona giornata.\\nDaniele Perna', '2015-04-30 07:42:38'),
(229, 144, 'r.debene@gmail.com', 'http://www.fiamsport.it/gare/org/index.php', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/42.0.2311.135 Safari/537.36', 'non so come ma mi ha registrato due volte la stessa gara. \\ndopo la prima conferma sono rientrato a modificare una dicitura (iban) per rendere più visibile il numero, dopo la conferma ho trovato due gare.\\nho bloccato la prima modificando la data di fine iscrizione ma è il caso di farla sparire e verificare il problema\\nciao Riccardo', '2015-05-06 17:58:51'),
(230, 153, 'gainko@gmail.com', 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=91', 'Mozilla/5.0 (Windows NT 6.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/42.0.2311.152 Safari/537.36', 'COACH', '2015-05-20 08:30:57'),
(231, 153, 'gainko@gmail.com', 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=91', 'Mozilla/5.0 (Windows NT 6.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/42.0.2311.152 Safari/537.36', 'BUONGIORNO BARBARA HO DIMENTICATO DI INSERIRE I COACH CHE SARANNO MERCURI SIMONE E CARLO PETRUCCI SE NON TI CREO PROBLEMI;POTRESTI GENTILMENTE FARLO TU ALTRIMENTI LO FARO\\'' IO IN SEDE DI GARA. MI SCUSO PER L\\''ERRORE, GRAZIE E BUONA GIORNATA', '2015-05-20 08:38:07'),
