(233, 123, 'crazyrobby73@gmail.com', 'http://www.fiamsport.it/gare/resp/index.php', 'Mozilla/5.0 (Windows NT 6.3; Trident/7.0; Touch; MASMJS; rv:11.0) like Gecko', 'Buongiorno Augusto,\\n\\nper il corso dei PDG che ho tenuto oggi a genova ho creato 2 gare di prova per illustrare le funzioni del sito. Queste 2 gare andrebbero eliminate e solo ru puoi farlo.\\n\\nle gare in questione sono:\\n- Trofeo Liguria 2016\\n- gara prova stage\\n\\nSarebbe utile poter avere il sito in modalità offline sui PC della commissione (abbiamo già intallato mysql e phpmyadmin che ci permetterebbe di far girare il tutto) con un database compilato con società ed atleti di fantasia giusto per insegnarne il funzionamento ai vari corsi senza dover per questo creare una gara sul sito che non serve a nulla. Se mi dici che la cosa potrebbe essere fattibile chiedo in direzione che diano l\\''ok in modo che ru ci possa inviare il tutto.\\n\\nPer il momento ti ringrazio.\\nSaluti\\nRoberto', '2015-06-14 19:07:54'),
