(282, 317, 'supporto@fiamsport.it', 'http://wkcrimini.fiamsport.it/gare/soc/', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/50.0.2661.102 Safari/537.36', 'Prova segnalazione 09/06/2016 ore 10:50', '2016-06-09 08:47:20'),
(283, 144, 'r.debene@gmail.com', 'http://www.fiamsport.it/gare/org/nuova.php', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/53.0.2785.116 Safari/537.36', '<p>scusa Augusto ma questa volta la gara qui sotto &egrave; stata aperta anche alle verdi-blu quella registrata &egrave; solo per marroni -nere</p>\\n<p>se no si sinseriscono anche le prime non posso aprire la gara</p>\\n<p>KATA (COPPA ITALIA RENGOKAI)</p>\\n<p>VERDI/BLU - MARRON/NERE<br />Regolamento &ldquo;WADOKAI EUROPE&rdquo; (WKF )-(sistema a bandierine)<br /> Kata libero<br />Verdi/Blu: non possono eseguire consecutivamente lo stesso kata<br />Mar/Nere: non possono mai eseguire lo stesso kata</p>\\n<p>&nbsp;</p>\\n<p>le categorie da inserire sono&nbsp;</p>\\n<ul>\\n<li>Kata Rengokai Cadetti A (U16) Maschile Verdi-Blu</li>\\n<li>Kata Rengokai Cadetti A (U16) Femminile&nbsp;Verdi-Blu</li>\\n<li>Kata Rengokai Cadetti B (U18) Maschile&nbsp;Verdi-Blu</li>\\n<li>Kata Rengokai Cadetti B (U18) Femminile&nbsp;Verdi-Blu</li>\\n<li>Kata Rengokai Junior (U21) Maschile&nbsp;Verdi-Blu</li>\\n<li>Kata Rengokai Junior (U21) Femminile&nbsp;Verdi-Blu</li>\\n<li>Kata Rengokai Senior (+21) Maschile&nbsp;Verdi-Blu</li>\\n<li>Kata Rengokai Senior (+21) Femminile&nbsp;Verdi-Blu</li>\\n</ul>\\n<p>grazie Riccardo</p>', '2016-09-26 17:52:57'),
(284, 35, 'gainko@gmail.com', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=120', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/53.0.2785.116 Safari/537.36', 'buongiorno e da ieri sera che tento di iscrivere i miei atleti alla coppa italia wadokai senza riuscirci in pratica cliccando sui moduli d\\''iscrizione non riesco ad inserire nessun dato, non mi compare nessuna lista sulla schermata atleti come di solito.grazie per la collaborazione buona giornata', '2016-10-07 06:10:00'),
(285, 153, 'gainko@gmail.com', 'http://www.fiamsport.it/gare/soc/iscrivi.php?id=120', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/53.0.2785.116 Safari/537.36', 'PROBLEMA RISOLTO AVEVO INSERITO I CODICI DI ACCESSO SBAGLIATI GRAZIE PER L\\'' ATTENZIONE', '2016-10-07 06:42:51'),
(286, 115, 'danielepernino@yahoo.it', 'http://www.fiamsport.it/gare/soc/', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.112 Safari/537.36', 'Buongiorno,\\nMa ci sono stati spostamenti di atleti tre le varie gare?\\nPerchè ho visto che il numero totale di atleti negli elenchi partecipanti e nei time table coincide, ma non trovo diverse categorie nei singoli time table delle tre gare!\\nGrazie, buona giornata.\\nDaniele', '2016-10-13 08:22:01'),
(287, 33, 'goroni.a@tiscali.it', 'http://www.fiamsport.it/gare/soc/riepilogo.php?id=130', 'Mozilla/5.0 (iPad; CPU OS 10_1_1 like Mac OS X) AppleWebKit/602.2.14 (KHTML, like Gecko) Version/10.0 Mobile/14B100 Safari/602.1', 'Abbiamo ancora problemi nell\\''inserimento di campioni e bareato che Non sono ancora sbloccati', '2016-11-18 17:28:14'),
