(292, 63, 'sabrysan@hotmail.com', 'http://www.fiamsport.it/gare/soc/', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/54.0.2840.99 Safari/537.36', 'Quasi tutti i gradi sono diversi nell\\''iscrizione individuale e a squadra. Per la maggior parte non fa differenza perché rimangono nella stessa categoria. Invece Tucci Simone e Parisi Riccardo sono marroni e se rimangono blu gli cambia la categoria. Grazie.', '2016-11-24 11:55:23'),
