(316, 33, 'augusto.barbini@gmail.com', 'http://www.fiamsport.it/gare/soc/riepilogosq.php?id=178', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.112 Safari/537.36', 'TROMBA ANDREA me lo da come \\"atleta da verificare\\". Va inserito nella mista di kumite a squadre con DI BELLO FEDERICA, STEFANO SARA e SANFILIPPO RICCARDO e nella squadra kumite maschile con SANFILIPPO RICCARDO', '2018-11-23 20:07:12'),
